DROP VIEW IF EXISTS `v_game_situation`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_game_situation` AS select `lottery`.`game`.`id` AS `id`,`lottery`.`game`.`game_code` AS `game_code`,`lottery`.`game`.`game_name` AS `game_name`,`lottery`.`game`.`order_no` AS `order_no`,`lottery`.`game`.`state` AS `state`,`lottery`.`game`.`game_desc` AS `game_desc`,`lottery`.`game`.`game_category_id` AS `game_category_id`,`lottery`.`game`.`hot_game_flag` AS `hot_game_flag`,(select sum(`rule`.`issue_count`) from (`lottery`.`issue_setting` `setting` left join `lottery`.`issue_generate_rule` `rule` on((`setting`.`id` = `rule`.`issue_setting_id`))) where (`setting`.`game_id` = `lottery`.`game`.`id`)) AS `issue_count`,`lottery`.`issue`.`issue_num` AS `current_issue`,`lottery`.`issue`.`issue_num_inner` AS `current_issue_inner`,`lottery`.`issue`.`end_time` AS `current_issue_end_time`,(select `pre_issue`.`issue_num` from `lottery`.`issue` `pre_issue` where ((`pre_issue`.`game_code` = `lottery`.`game`.`game_code`) and (`pre_issue`.`issue_num` < `lottery`.`issue`.`issue_num`)) order by `pre_issue`.`issue_num` desc limit 1) AS `pre_issue`,(select `pre_issue`.`lottery_num` from `lottery`.`issue` `pre_issue` where ((`pre_issue`.`game_code` = `lottery`.`game`.`game_code`) and (`pre_issue`.`issue_num` < `lottery`.`issue`.`issue_num`)) order by `pre_issue`.`issue_num` desc limit 1) AS `pre_issue_lottery_num`,(select `next_issue`.`issue_num` from `lottery`.`issue` `next_issue` where ((`next_issue`.`game_code` = `lottery`.`game`.`game_code`) and (`next_issue`.`start_time` > now())) order by `next_issue`.`lottery_time` limit 1) AS `next_issue`,(select `next_issue`.`end_time` from `lottery`.`issue` `next_issue` where ((`next_issue`.`game_code` = `lottery`.`game`.`game_code`) and (`next_issue`.`start_time` > now())) order by `next_issue`.`lottery_time` limit 1) AS `next_issue_end_time` from ((`lottery`.`game` left join (select `tmp`.`game_code` AS `game_code`,`tmp`.`order_num` AS `order_num` from (select `bo`.`game_code` AS `game_code`,count(1) AS `order_num` from `lottery`.`betting_order` `bo` where (`bo`.`betting_time` >= (now() - interval 5 day)) group by `bo`.`game_code`) `tmp` order by `tmp`.`order_num` desc) `b` on((`lottery`.`game`.`game_code` = `b`.`game_code`))) left join `lottery`.`issue` on(((`lottery`.`game`.`game_code` = `lottery`.`issue`.`game_code`) and (`lottery`.`issue`.`start_time` <= now()) and (`lottery`.`issue`.`end_time` > now())))) order by `b`.`order_num` desc;

