CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_lottery_situation` AS select `lottery`.`issue`.`id` AS `id`,`lottery`.`issue`.`end_time` AS `end_time`,`lottery`.`issue`.`game_code` AS `game_code`,`lottery`.`issue`.`issue_num` AS `issue_num`,`lottery`.`issue`.`lottery_date` AS `lottery_date`,`lottery`.`issue`.`lottery_num` AS `lottery_num`,`lottery`.`issue`.`lottery_time` AS `lottery_time`,`lottery`.`issue`.`start_time` AS `start_time`,`lottery`.`issue`.`state` AS `state`,`lottery`.`issue`.`sync_time` AS `sync_time`,`lottery`.`issue`.`version` AS `version`,`lottery`.`issue`.`settlement_time` AS `settlement_time`,`collect`.`total_betting_amount` AS `total_betting_amount`,`collect`.`total_winning_amount` AS `total_winning_amount`,`lottery`.`issue`.`automatic_lottery` AS `automatic_lottery`,`lottery`.`issue`.`automatic_settlement` AS `automatic_settlement` from (`lottery`.`issue` left join (select `bo`.`game_code` AS `game_code`,`bo`.`issue_num` AS `issue_num`,sum(`bo`.`total_betting_amount`) AS `total_betting_amount`,sum(`bo`.`total_winning_amount`) AS `total_winning_amount` from `lottery`.`betting_order` `bo` group by `bo`.`game_code`,`bo`.`issue_num`) `collect` on(((`lottery`.`issue`.`game_code` = `collect`.`game_code`) and (`lottery`.`issue`.`issue_num` = `collect`.`issue_num`))));

