DROP VIEW IF EXISTS `v_tracking_number_situation`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_tracking_number_situation` AS select `tmp_t`.`id` AS `id`,`tmp_t`.`order_no` AS `order_no`,`tmp_t`.`tracking_number_time` AS `tracking_number_time`,`tmp_t`.`game_code` AS `game_code`,`tmp_t`.`start_issue_num` AS `start_issue_num`,`tmp_t`.`base_amount` AS `base_amount`,`tmp_t`.`total_betting_amount` AS `total_betting_amount`,`tmp_t`.`win_to_stop` AS `win_to_stop`,`tmp_t`.`user_account_id` AS `user_account_id`,`tmp_t`.`total_issue_count` AS `total_issue_count`,`tmp_t`.`completed_issue_count` AS `completed_issue_count`,`tmp_t`.`uncompleted_issue_count2` AS `uncompleted_issue_count`,(case when (`tmp_t`.`uncompleted_issue_count1` > 0) then 1 else (case when (isnull(`tmp_t`.`max_cancel_order_time`) or (`tmp_t`.`max_sync_time` > `tmp_t`.`max_cancel_order_time`)) then 2 else 3 end) end) AS `state` from (select `tno`.`id` AS `id`,`tno`.`order_no` AS `order_no`,`tno`.`tracking_number_time` AS `tracking_number_time`,`tno`.`game_code` AS `game_code`,`tno`.`start_issue_num` AS `start_issue_num`,`tno`.`base_amount` AS `base_amount`,`tno`.`total_betting_amount` AS `total_betting_amount`,`tno`.`win_to_stop` AS `win_to_stop`,`tno`.`user_account_id` AS `user_account_id`,count(1) AS `total_issue_count`,sum((case when (`bo`.`state` in ('2','3')) then 1 else 0 end)) AS `completed_issue_count`,sum((case when (`bo`.`state` = '1') then 1 else 0 end)) AS `uncompleted_issue_count1`,sum((case when ((`bo`.`state` = '1') and (now() < `lottery`.`issue`.`end_time`)) then 1 else 0 end)) AS `uncompleted_issue_count2`,sum((case when (`bo`.`state` = '4') then 1 else 0 end)) AS `cancel_order_issue_count`,max(`lottery`.`issue`.`sync_time`) AS `max_sync_time`,max(`bo`.`cancel_order_time`) AS `max_cancel_order_time` from (((`lottery`.`tracking_number_order` `tno` left join `lottery`.`tracking_number_plan` `plan` on((`tno`.`id` = `plan`.`tracking_number_order_id`))) left join `lottery`.`betting_order` `bo` on((`plan`.`betting_order_id` = `bo`.`id`))) left join `lottery`.`issue` on((`bo`.`issue_id` = `lottery`.`issue`.`id`))) group by `tno`.`id`,`tno`.`order_no`,`tno`.`tracking_number_time`,`tno`.`game_code`,`tno`.`start_issue_num`,`tno`.`base_amount`,`tno`.`total_betting_amount`,`tno`.`win_to_stop`,`tno`.`state`) `tmp_t`;

