INSERT INTO `lottery_information` VALUES ('1133785806842888192', '<p style=\"text-indent: 2em; text-align: left;\">5月21日，福彩双色球第58期开奖，来自南京的幸运彩民林先生（化姓）幸运中得当期大奖26275元。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/29/1191299_500x500.jpg\" title=\"1\" alt=\"1\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">据了解，林先生是一位老彩民，平时把购彩作为自己娱乐生活的一部分。他投注最多的当属刮刮乐和双色球了，每天吃完晚饭后在散步的时候都会顺便去投注站投几注或者跟彩友们聊聊最近的彩市。</p>\n<p style=\"text-indent: 2em; text-align: left;\">5月21日，林先生在投注站跟彩友聊到最近的双色球开奖号码时，脑子里突然出现几个号码，随即拿出纸笔在纸上写了出来，时不时的还问问身边的彩友觉得这个号码怎么样。不一会儿，林先生的纸上就出现了一组红球复式号，并果断投了一注。当晚开奖，林先生在网上查到了开奖号码，一个个熟悉的号码出现，果然他的预感是对的。虽然号码没有全中，但能中得2万多元他表示已经很开心了。第二天一早，他便来到了南京市福彩中心兑取了大奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">谈及兑奖后的感受，他表示，作为福彩的忠实粉丝，购彩这么多年，在给自己带来快乐的同时又做了公益，感到很开心。而且通过购彩，他也结识了很多志趣相投的朋友，为生活增添了很多色彩。</p>', NULL, '江苏福彩网', '灵感来袭 南京彩民笑纳双色球奖金2.6万元', '2019-05-29 13:49:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785806935162880', '<p style=\"text-align: left; text-indent: 2em;\">5月28日晚，中国福利彩票双色球游戏进行第2019061期开奖。当期双色球红球号码为03、17、19、24、27、31，蓝球号码为12。<span style=\"font-family: inherit; text-indent: 2em;\">当期双色球头奖6注，单注奖金为844万多元。这6注一等奖花落5地，北京1注，安徽1注，重庆2注，四川1注，陕西1注，共6注。</span></p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/29/1191326_500x500.png\" title=\"2019061双色球一等奖中奖明细\" alt=\"2019061双色球一等奖中奖明细\" suffix=\"png\"></p>', NULL, '中彩网', '2019061期双色球一等奖中奖明细', '2019-05-29 11:54:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785806956134400', '<p style=\"text-align: left; text-indent: 2em;\">为回馈河北省彩民对福利彩票的支持与厚爱，提升3D游戏品牌影响力，河北省福彩中心决定自6月1日起开展福彩3D游戏1000万元赠票促销活动。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/29/1191236_500x500.jpg\" title=\"微信图片_20190529112226\" alt=\"微信图片_20190529112226\" suffix=\"jpg\"></p>\n<p style=\"text-align: left; text-indent: 2em;\">活动规则：活动期间，彩民购买单张单期金额20元（含）以上的3D彩票，即可获赠6元3D彩票一张（3注单选，机选）；购买单张单期金额50元（含）以上的3D彩票，即可获赠16元3D彩票一张（4注2倍单选，机选）；购买单张单期金额100元（含）以上的3D彩票，即可获赠40元3D彩票一张（5注4倍单选，机选）。以上赠票参与方式只有一次赠票机会。</p>\n<p style=\"text-align: left; text-indent: 2em;\">本次活动共赠送1000万元的3D游戏彩票，赠票送完活动即时停止，不再追加赠票资金。</p>', NULL, '燕赵福彩网', '河北3D游戏1000万赠票活动6月1日开启', '2019-05-29 11:34:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785806981300224', '<p style=\"text-indent: 2em; text-align: left;\">“哈哈哈，是的，是的，是我的彩票站中出一个492万元的大奖。”5月27日一早，原本寂静的淄博市桓台县工业路怡和花园南门的37036023号福彩站点人声鼎沸、热闹异常，站主李雪锋女士更是乐得合不拢嘴。原来，在昨晚开奖的双色球第2019060期，该站一彩友以自选倍投20倍的方式，拿下492万元大奖。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/29/1191186_500x500.png\" title=\"1\" alt=\"1\" suffix=\"png\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">“高兴是高兴，总感觉太可惜。中奖的这张彩票仅花费40元，是一张20倍倍投的自选单式票，命中6个红球号码，因一蓝之差与20注一等奖擦肩，错失亿元巨奖（单注奖金按500万计算），却也幸运收获492万元二等奖。”在为彩友扼腕叹息之时，李雪锋也讲述起起自己获知中奖的经过：“当晚，区县配管员就给我留言告知中奖喜讯，但因当时家里老人身体不适，没顾上查看信息，直到第二天一早再次接到配管员的报喜电话后，才意识到自己站上中出了大奖。急忙赶到站上打开投注站核时，看到中奖提示时，还有点不敢相信，幸运会降临到自家站里。”</p>\n<p style=\"text-indent: 2em; text-align: left;\">虽说突如其来的喜讯，让李雪锋激动不已，但她仍没忘第一时间通过朋友圈和微信群将这一喜讯分享出去，同时打电话让老公、儿子来站里帮忙。一番兴师动众的宣传，让这个“幸运之极”的站点格外热闹起来。</p>\n<p style=\"text-indent: 2em; text-align: left;\">对于这个差点拿下亿元巨奖的站点，赶来沾喜气和碰好运的彩友纷纷竖起大拇指，就连平日里极少光顾的新面孔，此时也争相进站买彩票、沾喜气。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/29/1191187_500x500.png\" title=\"2\" alt=\"2\" suffix=\"png\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">问及中奖者是谁，为何选用倍投方式投注，这一彩友们关心的话题时，李雪锋分析道，很有可能是位老彩友，采用守号的方式进行了投注。一来站上购彩的群体不是附近上班的，就是周边社区居民，都是老面孔；二来进站买彩的多为双色球的忠实拥趸者；三来从投注的方式来看，这多为彩友守号时惯用的一种方式，特别是老彩友采用最多。综合上述三点，可以断言是位老彩友，但是具体到某一位彩友身上有难度。再说就算知道，咱也不能说，得替彩友保密。</p>', NULL, '山东彩票网', '差点拿下亿元巨奖 20倍倍投带走492万元', '2019-05-29 10:42:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807006466048', '<p style=\"text-indent: 2em; text-align: left;\"><strong>中彩网讯</strong>&nbsp;5月28日晚，中国福利彩票双色球游戏进行第2019061期开奖。<strong><span style=\"color: rgb(255, 0, 0);\">当期双色球红球号码为03、17、19、24、27、31，蓝球号码为12。</span></strong></p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>头奖6注844万元 花落5地</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">当期双色球头奖6注，单注奖金为844万多元。这6注一等奖花落5地，北京1注，安徽1注，重庆2注，四川1注，陕西1注，共6注。</p>\n<p style=\"text-indent: 2em; text-align: left;\">二等奖开出80注，单注金额32万多元。其中，湖北中出10注，排名第一；山东中出7注，排名第二；河南、上海分别中出6注，并列排名第三；湖南、北京、陕西分别中出5注，并列排名第五；此外，其它地区二等奖均低于5注。当期末等奖开出786万多注。</p>\n<p style=\"text-indent: 2em; text-align: left;\">当期红球号码大小比为5:1，三区比为1:2:3；奇偶比为5:1。其中，红球开出两枚重号03、27；一组同尾号17、27；三枚斜连号03、19、24；一组奇连号17、19；蓝球则开出12。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>奖池6.55亿多元</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">当期全国销量为3.35亿多元。广东（不含深圳）当期双色球销量为3293万多元，高居第一；浙江以2662万多元的销量位列第二；山东以2054万多元排名第三；江苏以2050万多元排名第四；四川则以1683万多元排名第五。</p>\n<p style=\"text-indent: 2em; text-align: left;\">计奖后，双色球奖池金额为6.55亿多元，下期彩民朋友将有机会2元中得1000万元。</p>\n<p style=\"text-indent: 0em; text-align: center;\">双色球第2019061期开奖号码公告</p>\n<div>\n <p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/28/1191093_500x500.png\" title=\"屏幕快照 2019-05-28 下午10.33.05\" alt=\"屏幕快照 2019-05-28 下午10.33.05\" suffix=\"png\"></p>\n</div>', NULL, '中彩网', '双色球061期：头奖6注844万 奖池6.55亿', '2019-05-28 22:34:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807027437568', '<p style=\"text-indent: 2em; text-align: left;\">双色球第2019061期开奖结果：</p>\n<p style=\"text-indent: 2em; text-align: left;\">红球：03 17 19 24 27 31</p>\n<p style=\"text-indent: 2em; text-align: left;\">蓝球：12</p>', NULL, '中彩网', '双色球061期开奖结果:03 17 19 24 27 31+12', '2019-05-28 21:26:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807048409088', '<p style=\"text-align: left; text-indent: 2em;\">5月21日，双色球第2019058期全国开出一等奖20注，单注奖金526万多元，陕西省渭南彩民7+1复式守号投注再揽其中1注，收获奖金527万元。</p>\n<p style=\"text-align: left; text-indent: 2em;\">据省福彩中心检索，中奖彩票是5月20日19时53分售出于渭南市华县75#信箱生活区福彩61051912号投注站，为7+1复式自选票守号投注，该彩票中得一等奖1注、三等奖6注，揽获总奖金527万多元。</p>\n<p style=\"text-align: left; text-indent: 2em;\">为鼓励中奖站点更好地为彩民服务，5月22日，渭南市福彩中心副主任冯高峰第一时间携工作人员一行来到大奖诞生地，为幸运投注站颁发奖牌表示祝贺。</p>\n<p style=\"text-align: left; text-indent: 2em;\">福彩61051912号投注站位于华州区新秦南路七五十字，这是一家经营了15年的老店，是渭南第一批示范店，也是国标示范店和诚信投注站，在华州区名列前茅。据投注站业主郝伟介绍，他家投注站先前没中过太大的奖项，他的理念是细水长流，为彩民做好服务的同时，劝导彩民理性投注，平时会向彩民宣传福彩公益性，使彩民认识到无论是否中奖，每一次购彩都是在奉献爱心。</p>\n<p style=\"text-align: left; text-indent: 2em;\">一得知自家投注站中出了双色球超值大奖，郝伟甚至比彩民都要高兴，立即张罗着，要借机好好宣传一番。投注站的门口围满了来往的群众，鞭炮声此起彼伏、锣鼓喧天，大奖消息吸引着更多购彩者来到旺地一试运气。</p>\n<p style=\"text-align: left; text-indent: 2em;\">据悉，这是继5月19日延安彩民胆拖票守号投注揽获双色球827万元大奖以来，短短两天，陕西省彩民两期连揽2注大奖。这是华州区近十年来中出的首个双色球一等奖，也是渭南彩民今年中得的第2注双色球超值大奖。至此，陕西省彩民今年已收获双色球一等奖32注。</p>\n<p style=\"text-align: left; text-indent: 2em;\">目前双色球奖池金额6.28亿元，陕西省彩民仍有机会2元中得1000万元。下一个大奖花落谁家，值得期待。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/28/1191084_500x500.png\" title=\"图片7\" alt=\"图片7\" suffix=\"png\"></p>', NULL, '陕西福彩', '又是守号！渭南彩民再揽527万元大奖', '2019-05-28 14:19:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807073574912', '<p style=\"text-align: left; text-indent: 2em;\">近期陕西600万元大派奖燃爆彩市，全省3D游戏爱好者热情高涨，随时随地看号找灵感成为新浪潮，相互切磋谁中奖多是新常态。近来各地涌现出不少3D达人，人杰地灵的宝鸡必须当仁不让。这不，有位青年才俊思路精奇打法独特，又是中奖常客，被彩友们戏称为宝鸡“3D王”。</p>\n<p style=\"text-align: left; text-indent: 2em;\">大派奖刚开始不久，宝鸡“3D王”就尝到大派奖的甜头。原来，他借着派奖特意加大了投注，认准百位十位个位“奇偶奇”组合，投注了单选位选全奇全偶全奇复式17倍，投入4250元，收获了3D游戏20400元超值回报。</p>\n<p style=\"text-align: left; text-indent: 2em;\">作为技术型彩民，宝鸡“3D王”每次投注前都要花一个多小时看号，研究近期百位、十位、个位走势，再看和值、跨度、奇偶、和尾分布，最终综合推算下期可能开出的号码。</p>\n<p style=\"text-align: left; text-indent: 2em;\">据宝鸡“3D王”分析，单选从1040元提升至1200元；组选三全包只需要180元，本次3D派奖后奖金是400元；组选六全包也就240元，而派奖后奖金是200元。判断一下和值余数就会有较高回报。经过研判他感觉和值7可能性较大，就选择了单选全包点7投注，共36种组合，投注了18倍，当期3D开奖号码331，让他一举揽获21600元奖金。</p>\n<p style=\"text-align: left; text-indent: 2em;\">宝鸡“3D王”还认为，这次决胜派奖的前提，是研判好主攻单选、组选三、组选六，就会有较大胜算和回报。</p>\n<p style=\"text-align: left; text-indent: 2em;\">由于派奖只针对单选、组选三、组选六，宝鸡“3D王”还从多组预测号码中选出自认为可能性最大的进行单选倍投，也为保险起见，每组重点预测号码他都有组选跟进。</p>\n<p style=\"text-align: left; text-indent: 2em;\">同时，为了获得更好的收益，宝鸡“3D王”也尝试了多种投注方法，比如7个号的复式组选、1胆码或2胆码的胆拖复式、定位单选复式等等，这些大都成了他的中奖利器。</p>\n<p style=\"text-align: left; text-indent: 2em;\">本次大派奖预计派送至6月6日，即3D游戏2019131期至2019150期，连续派奖20期。广大彩民在享有派奖回馈的同时，今年的五月和六月份，宝鸡市各投注站根据站点中奖情况还有机会赢得市福彩中心的特别奖励。</p>\n<p style=\"text-align: left; text-indent: 2em;\">期待600万元派奖，好运伴您福厚彩旺。犹豫什么？让我们一起搭乘好运大巴，向快乐出发吧！</p>', NULL, '陕西福彩', '陕西600万元大派奖！宝鸡惊现“3D王”', '2019-05-28 14:14:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807098740736', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">期期10万元现金奖励，周周一辆奔驰汽车！重庆福彩双色球“相逢二四七·幸运@你”活动正在火热进行。据了解，5月21日至6月16日的双色球开奖日（周二、周四、周日）17:30-20:00，凡购买双色球单票金额20元（含）以上，投注机出票同时，将随机送出一张“幸运券”，金额在0元至5000元不等（中奖金额将直接在“幸运券”上显示）。每期10万元现金奖励，活动12期，总共送出奖金120万元。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">获得“幸运券”的彩民，无论是否中出现金奖励，都别忘了扫一扫“幸运券”上的条形码。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">根据活动规则，每张“幸运券”上的条形码都有一次机会参与“笑出大奖”抽奖活动，奖品为奔驰汽车A180和价值200元的幸运大礼包。活动期间，重庆福彩每周设有奔驰汽车1辆、价值200元的幸运大礼包200个，彩民只需登陆“重庆笑脸”小程序平台，使用该平台的扫一扫功能，扫描“幸运券”上的条形码，成功晒出自己的笑脸，即可获得当周奔驰汽车（税费由中奖者自行承担）、价值200元礼包的双重抽奖资格。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">每张“幸运券”只能参加当周的抽奖活动，条形码有效时间为每周日晚24:00前，一经扫描当即失效。抽奖活动将于每周二（5月28日、6月4日、6月11日、6月18日）下午在重庆福彩“幸运直播间”举行，从上周所有参与者中抽取中奖彩民，抽奖过程由公证处进行现场公证。</p>\n<p>&nbsp;</p>', NULL, '重庆福彩网', '现金！奔驰！大礼包！重庆福彩幸运等您来', '2019-05-28 10:29:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807123906560', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">5月23日，常州金坛中福在线双喜临门，两位彩民分别在南环一路销售厅和华城路销售厅内拍出25万元最高累积奖。令彩民朋友们津津乐道的是，这两个大奖的出奖间隔不过短短两个小时。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">当天，南环一路销售厅首先迎来25万元大奖。据了解，该厅的中奖彩民韩先生（化名）是中福在线的老彩民，闲暇时都会到厅里来坐坐。当天下午，他来到厅内充卡后，就坐到2号终端机前，以5注单注100分的投注方式玩“连环夺宝”游戏。18点51分左右，当他玩到游戏第二关时，屏上忽然落下22颗猫眼石。他兴奋地呼喊道：“我又拉奖池了！”原来，这是韩先生第二次拍出25万元大奖了。尽管有过中奖经历，当大奖再次降临时，韩先生依然十分激动，倍感惊喜。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">当晚20点50分，华城路销售厅也传出了大奖喜讯，又有一位彩民黄先生（化名）幸运中得25万元大奖。据了解，黄先生同样是中福在线的老彩民，当时正好在金坛出差。当天吃过晚饭后，他来到华城路销售厅休闲，选了18号终端机玩“连环夺宝”游戏。很快，游戏到了第三关，只见屏上忽然下起了宝石雨，足足出现了24颗红宝石。黄先生乐呵呵地表示，这是他5天之内中得的第2个25万元大奖，感谢幸运女神的眷顾，今后仍会以平常心保持这份爱好，充分享受游戏带来的愉悦与放松。</p>\n<p>&nbsp;</p>', NULL, '江苏福彩网', '常州金坛中福在线上演“连环夺宝”大奖连环', '2019-05-27 15:16:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807144878080', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">5月22日12点27分，无锡中福在线南禅寺销售厅爆机。彩民张先生中奖25万大奖，表现得若无其事，继续淡定投注。直到第三关游戏结束后，到窗口办理退卡时才淡淡说了句“我爆机了”。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">张先生今年三十岁，经常往南禅寺景区送货。平时工作较忙，但一有时间他就会到南禅寺销售厅消遣娱乐。中奖当天，张先生送完货后便来到南禅寺销售厅，充完卡后选择了常坐的3号机进行投注。前两关都是以每条线100分进行投注，到了第三关时他把分数提高到每条线200分，在第三关即将结束时突然收获24颗红宝石，幸运中得了25万元奖金。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">屏幕上出现“恭喜中得累积奖250000元”时，张先生很是淡定，仍然视而不见继续投注。一旁的彩友说：“当时就坐在他旁边的投注机上，就没发现他爆机，直到他给老婆打电话，让拿身份证来兑奖才知道爆机了。”</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">当拿到奖金支票，张先生才露出喜悦，他说：“玩中福在线七八年了，看到身边好几个彩友到中了大奖，现在也终于轮到我啦！”</p>\n<p>&nbsp;</p>', NULL, '江苏福彩网', '无锡淡定彩民对累积奖25万元“视而不见”', '2019-05-27 15:13:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807165849600', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">5月26日晚，中国福利彩票双色球游戏进行第2019060期开奖。当期双色球红球号码为03、04、14、20、23、27；蓝球号码为01。当期双色球头奖2注，单注奖金为1000万元。这2注一等奖花落2地，河南1注,广东1注,共2注。</p>\n<p style=\"TEXT-ALIGN: center\"><img title=\"112019059期双色球一等奖明细_副本\" alt=\"112019059期双色球一等奖明细_副本\" src=\"http://www.zhcw.com/upload/resources/image/2019/05/27/1190782_500x500.jpg\" suffix=\"jpg\"></p>\n<p style=\"TEXT-ALIGN: center\">&nbsp;</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"></p>', NULL, '中彩网', '2019060期双色球一等奖中奖明细', '2019-05-27 15:04:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807186821120', '<p style=\"text-indent: 2em; text-align: left;\">5月19日，双色球游戏第2019057期开奖，开出红球号码为；18、04、13、05、06、08，篮球号码为16。开奖结束，全国中出一等奖7注，单注奖金高达821万元，二等奖全国中出127注，单注奖金高达22万元。茂名市高州长坡镇44162017福彩投注站传来喜讯，该站点彩民以一张10元5注的机选票喜获当期双色球二等奖1注，收获奖金22万元。</p>\n<p style=\"text-indent: 2em; text-align: left;\">5月21日，中奖彩民李先生（化姓）来到茂名市福彩中心领取了属于他的幸运大奖，在兑奖过程中笑着与工作人员分享他的购彩经历。李先生是一位老彩民，一直钟情于双色球，只要有时间都会去投注站买上几注双色球。这次是他第一次中二等奖，以前也中过5元、10元、200元的小奖。李先生觉得自己还是蛮幸运的，中奖后一开始还有点不敢相信，后来他又上网查询中奖号码，这才敢相信。真是太幸运了！</p>\n<p style=\"text-indent: 2em; text-align: left;\">问及奖金如何支配时？李先生表示，我还没有将中奖喜讯告诉家人，准备今天领完奖金后再告诉父母，给他们一个大惊喜，回家后要好好庆祝一下。这次中奖来的比较及时，父母一直都想回老家建房子，但由于资金问题一直没有如愿，现在有了这笔奖金再想办法凑一部分钱就可以回老家建建房子了。</p>\n<p style=\"text-indent: 2em; text-align: left;\">多年购彩已经成了李先生的一种习惯，无论走到哪里，只要有时间他都会选几注号码，这次终于让他等到了。李先生还告诉我们：“虽然未能中得头奖，但我也很知足，这注二等奖也算是对我多年坚持购彩的一种回报。任何事情只要耐心坚持，就一定会得到想要的结果，希望这份幸运大奖能够帮助我把老家的房子建好，再次感谢福彩带给我这份好运，以后还会继续支持中国福利彩票，更希望以后可以有机会中出一个双色球头奖”。</p>', NULL, '广东福彩网', '茂名彩民喜中双色球大奖 如愿回家建房', '2019-05-27 11:17:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807211986944', '<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/27/1190723_500x500.jpg\" title=\"1\" alt=\"1\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: center;\">市福彩中心为中奖站点庆功</p>\n<p style=\"text-indent: 2em; text-align: left;\">近期广州彩市大奖频频、喜讯不断，就在荔湾区街坊撞中双色球千万大奖的一周后，位于越秀区百灵路29号的44010045投注站又传出中奖喜讯：来自海珠区的一位街坊在该站购买的一张56元“8+1”自选复式票中得双色球第2019058期头奖1注，总奖金530万元。据统计，今年截至目前，广州彩民已摘得23注双色球一等奖，平均下来每个星期都能中得1注头奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>街坊现场选号摘530万元</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">据了解，5月21日晚，福彩双色球第2019058期开奖，当期开出的红球号码为“07、08、12、21、23、27”，蓝球号码为“12”。当期全国井喷20注一等奖，单注奖金为526万多元。这20注一等奖花落全国14地，其中花落广东的唯一1注头奖继续由广州彩民包揽。经检索，中奖站点为越秀区百灵路29号44010045投注站，中奖彩票为一张56元“8+1”的自选复式票。由于中奖彩民采用复式投注，除中得1注一等奖526万元外，还额外中得12注三等奖和15注四等奖，总奖金约530万元。</p>\n<p style=\"text-indent: 2em; text-align: left;\">距离开奖时隔两天后，本次大奖得主汤先生（化名）在家人的陪同下来到市福彩中心兑奖。据他介绍，中奖彩票购于5月21日上午，“我家住海珠，当天来越秀区处理工作，刚好路过百灵路时看到有家福彩投注站，便现场选了一注复式号码，哪里会想到能中大奖呢！”</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>首次中大奖“心情很紧张”</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">据了解，汤先生是位福彩老彩民，购彩史已超过20年，“我马上快退休了，也没什么特别的喜好，平时就爱买买双色球彩票，每次路过福彩投注站时就会买上一两张”。汤先生购彩一直有个习惯，在投注前他会研究往期开奖号码走势图，并凭感觉选定投注号码。5月21日星期二是双色球第2019058期开奖日，汤先生路过44010045站又起了购彩的想法，随手翻开站点内保存的2018年双色球开奖记录，便灵机一动找出了2018058期前后的开奖号码，并根据自己投注多年总结的“连号、单双号”等方法选择了一组红球“07、08、12、15、19、21、23、27”，篮球“12”的复式号码。</p>\n<p style=\"text-indent: 2em; text-align: left;\">汤先生表示平时购彩后他会关注开奖公告，但由于当天是现场临时选号，他对投注号码印象不深，也“懒的把彩票找出来核对”，因此一直到第二天下午，他出门路过家附近的一家投注站并让销售员验票后，才发觉自己中了一等奖。“当时彩票过机后显示的中奖结果是‘请到市福彩中心兑奖’，我就知道中了大奖，没想到是一等奖！”汤先生说道。</p>\n<p style=\"text-indent: 2em; text-align: left;\">据介绍，汤先生从事物业管理工作，虽然经常与人打交道，但在办理兑奖时他却坦言“第一次中这么大的奖，心里特别慌张，希望奖金尽快落袋为安”。紧张的不止汤先生一人，陪同他前来兑奖的姐姐似乎更加谨慎，当汤先生在向工作人员分享中大奖经历时，陪在一旁的她不断提醒汤先生不要说太多，办理完兑奖手续后，也一直催促汤先生尽快离开。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>56元购彩金获免单</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">在离开前，汤先生透露，自己购彩很理性，不会在娱乐项目上乱花钱，每次购彩的费用多在一二十元，这次购彩之所以选择一张“8+1”的彩票是为了参与近期双色球促销活动。“我平时购彩就喜欢小复式投注，这次刚好赶上双色球促销，我就把金额稍微提高了一些，没想到撞了好彩！”汤先生兴奋地说道。</p>\n<p style=\"text-indent: 2em; text-align: left;\">据了解，自4月18日开始，广东省福彩中心在全省范围内（不含深圳市）开展了“幸运双色球，你中奖我买单”赠票活动，活动期间，凡以“7＋1”、“7＋2”、“8＋1”、“8＋2”“9＋1”、“10＋1”等6种复式方式购买全省辖区内（深圳市除外）发行销售的双色球彩票且中奖的，即返还与彩票投注金额相等的购票金或等值的双色球彩票。由于目前该活动还在继续开展，根据促销规则，汤先生购买的“8+1”彩票符合免单条件，他本次购彩花费的56元将获全额退还。</p>', NULL, '广东福彩网', '广州彩民5月撞好彩 又有街坊中双色球530万', '2019-05-27 10:56:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807232958464', '<p style=\"text-align: left; text-indent: 2em;\">5月31日起，江西福彩3D游戏开展300万元营销活动。活动期间，对3D游戏的单选、组选、2D进行促销，按照中奖注数在获得常规奖金的基础上，另行赠送一定金额的刮刮乐彩票。另外针对购买2D包号套餐中奖的彩民，再赠送精美礼品一份。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>奖上加奖&nbsp;&nbsp;返奖率高达75%</strong></p>\n<p style=\"text-align: left; text-indent: 2em;\">活动期间，对3D游戏的单选、组选、2D进行促销，按照中奖注数在获得常规奖金的基础上，另行赠送一定金额的刮刮乐彩票。 &nbsp;</p>\n<p style=\"text-align: left; text-indent: 2em;\">其中，对3D单选玩法单注赠送260元刮刮乐彩票，赠送后单注奖金高达1300元，返奖率65%；对3D组3玩法单注赠送104元刮刮乐彩票，赠送后单注奖金高达450元，返奖率67.5%；对3D组6玩法单注赠送57元刮刮乐彩票，赠送后单注奖金高达230元，返奖率69%；对3D游戏中2D玩法单注赠送46元刮刮乐彩票，赠送后单注奖金高达150元，返奖率75%。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>2D包号套餐 &nbsp;奖金礼品兼得</strong></p>\n<p style=\"text-align: left; text-indent: 2em;\">此次活动还推出了2D包号套餐，凡是购买2D包号套餐中奖的彩民，在获得奖金的同时，还可再获得精美礼品一份，可谓一举两得，惊喜翻倍。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>包号套餐随心选&nbsp;&nbsp;奖金还翻倍</strong></p>\n<p style=\"text-align: left; text-indent: 2em;\">2D包号套餐分为随选一和随选二两种。根据中奖号码，奖金还有机会进行翻倍，单注最高奖金450元。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>随选一：</strong>从0-9中随意选择1个号码，对2D进行包号投注，单注投注金额60元，只要所选号码在3个开奖号码当中即中奖（不排序），促销期间单注中奖奖金150元；如果所选号码在3个开奖号码中出现2次，则奖金翻倍，如果出现3次，则奖金翻三倍。例如：选择号码“1”进行2D随选一投注，如3D开奖号码为“123”，则中奖150元，如开奖号码为“112”，号码“1”出现两次，则中奖300元，如开奖号码为“111”，号码“1”出现三次，则中奖450元。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>随选二：</strong>从0-9中随意选择2个号码（不相重），对2D进行包号投注，单注投注金额12元，只要所选的2个号码都包含在3个开奖号码当中即中奖（不排序），促销期间单注中奖奖金150元；例如：以“12”进行随选二投注，如果3D开奖号码为“123”，则中奖150元；如果3D开奖号码为“112”或“122”，则奖金翻倍。</p>', NULL, '江西福彩网', '江西福彩3D即将开展300万元营销活动', '2019-05-27 09:58:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807258124288', '<p style=\"text-align: left; text-indent: 2em;\"><strong>中彩网讯</strong> 5月26日晚，中国福利彩票双色球游戏进行第2019060期开奖。<strong><span style=\"color: rgb(255, 0, 0);\">当期双色球红球号码为03、04、14、20、23、27；蓝球号码为01。</span></strong></p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>头奖2注1000万元 花落2地</strong></p>\n<p style=\"text-align: left; text-indent: 2em;\">当期双色球头奖2注，单注奖金为1000万元。这2注一等奖花落2地，河南1注,广东1注,共2注。<br style=\"text-align: left; text-indent: 2em;\"></p>\n<p style=\"text-align: left; text-indent: 2em;\">二等奖开出118注，单注金额24万多元。其中，山东中出25注，排名第一；广东（不含深圳）中出14注，排名第二；贵州中出11注，排名第三；湖南中出10注，排名第四；江苏、浙江分别中出7注，并列排名第五。另外，其它地区二等奖均低于7注。当期末等奖开出764万多注。</p>\n<p style=\"text-align: left; text-indent: 2em;\">当期红球号码大小比为3:3，三区比为2:2:2；奇偶比为3:3。其中，红球开出一组二连号03、04；两枚斜连号03、04；一枚重号04；两枚隔码23、27；两组同尾号04、14，03、23；蓝球则开出01。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>奖池6.28亿多元</strong></p>\n<p style=\"text-align: left; text-indent: 2em;\">当期全国销量为3.67亿多元。广东（不含深圳）当期双色球销量为3855万多元，高居第一；浙江以2936万多元的销量位列第二；山东以2229万多元排名第三；江苏以2188万多元排名第四；四川则以1827万多元排名第五。</p>\n<p style=\"text-align: left; text-indent: 2em;\">计奖后，双色球奖池金额为6.28亿多元，下期彩民朋友将有机会2元中得1000万元。</p>\n<p style=\"text-align: center; text-indent: 2em;\">双色球第2019060期开奖号码公告</p>\n<p style=\"text-align:center;\"><img title=\"QQ截图20190526221834\" alt=\"QQ截图20190526221834\" src=\"http://www.zhcw.com/upload/resources/image/2019/05/26/1190587_500x500.png\" suffix=\"png\"><br style=\"text-align: left; text-indent: 2em;\"></p>', NULL, '中彩网', '双色球060期：头奖2注1000万 奖池6.28亿', '2019-05-26 22:34:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807283290112', '<div style=\"text-align: left; text-indent: 2em;\">\n 双色球第2019060期开奖结果：\n</div>\n<div style=\"text-align: left; text-indent: 2em;\">\n 红球：03 04 14 20 23 27\n</div>\n<p style=\"text-align: left; text-indent: 2em;\">蓝球：01</p>\n<p><br style=\"text-align: left; text-indent: 2em;\"></p>', NULL, '中彩网', '双色球060期开奖结果:03 04 14 20 23 27 +01', '2019-05-26 21:29:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807304261632', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">5月23日晚，中国福利彩票双色球游戏进行第2019059期开奖。当期双色球红球号码为04、05、07、09、16、18，蓝球号码为06。当期双色球头奖2注，单注奖金为1000万元。这2注一等奖花落2地，湖北1注，广西1注，共2注。</p>\n<p style=\"TEXT-ALIGN: center\"><img title=\"QQ图片20190524133716\" alt=\"QQ图片20190524133716\" src=\"http://www.zhcw.com/upload/resources/image/2019/05/24/1190490_500x500.png\" suffix=\"png\"></p>', NULL, '中彩网', '2019059期双色球一等奖中奖明细', '2019-05-24 13:43:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807321038848', '<p style=\"text-indent: 2em; text-align: left;\">5月7日晚，中国福利彩票双色球游戏进行第2019052期开奖，当期开出红球03、06、09、13、16、19，蓝球16。全国一等奖出现井喷，共中出153注，单注奖金511万余元。湖南彩民幸运收获其中3注一等奖，中出头奖的幸运站点分别为：株洲攸县网岭监狱43034025站点;永州冷水滩区交通局旁43116059站点;怀化溆浦县国税局旁43123815站点。</p>\n<p style=\"text-indent: 2em; text-align: left;\">近日，株洲攸县的王先生跟朋友一起来到省中心兑取了奖金。王先生买彩多年，一直钟爱双色球游戏，基本期期不落，而他最喜欢的投注方式就是复式投注，而且有意思的是，他一般都会采用机选的方式，然后再进行守号，隔一两个月再换一组号码。这次中奖的号码就是如此产生的，王先生说到，这组号码已经守了快两个月的时间了，想着过两期就换一注号码，不想中了一注一等奖。当天晚上王先生就知道自己中奖，非常激动，当晚一晚都没有睡着，本想着第二天就来领奖，谁知有事耽误了。等到兑奖的时候，激动的心情已经平复了不少，但是当拿到奖金支票的时候，还是又有点小兴奋了。</p>\n<p style=\"text-indent: 2em; text-align: left;\">王先生这次采用的是6+5的复式投注，除了1注一等奖外，还收获了4注二等奖，奖金合计515万余元。王先生表示这笔奖金一部分用来改善生活环境，一部分用来做点小生意，然后回去换一注双色球号码继续守号。钟琪</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/24/1190458_500x500.jpg\" title=\"5\" alt=\"5\" suffix=\"jpg\"></p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/24/1190459_500x500.jpg\" title=\"6\" alt=\"6\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: center;\">图为中奖彩票和兑奖支票</p>', NULL, '湖南福彩', '“守”出来的双色球大奖515万余元', '2019-05-24 11:36:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133785807346204672', '<p style=\"TEXT-ALIGN: center\"><img title=\"云南1.webp\" alt=\"云南1.webp\" src=\"http://www.zhcw.com/upload/resources/image/2019/05/24/1190435_500x500.jpg\" suffix=\"jpg\"></p>\n<p style=\"TEXT-ALIGN: center\"><img title=\"云南2.webp\" alt=\"云南2.webp\" src=\"http://www.zhcw.com/upload/resources/image/2019/05/24/1190436_500x500.jpg\" suffix=\"jpg\"></p>\n<p style=\"TEXT-ALIGN: center\"><img title=\"云南3.webp\" alt=\"云南3.webp\" src=\"http://www.zhcw.com/upload/resources/image/2019/05/24/1190437_500x500.jpg\" suffix=\"jpg\"></p>', NULL, '云南福彩公众号', '云南福彩双色球9+1模拟投注大赛即将开启', '2019-05-24 11:28:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133978737683988480', '<p style=\"text-indent: 2em; text-align: left;\">即日起，参与“双色球、3D超级双享惠”和“刮己亥猪票赢幸运大奖”主题活动，仍有机会赢取华为P30pro手机、戴森吹风机等丰富豪礼！更有电子赠券，猪年套票等超多福利。</p>\n<p style=\"text-indent: 2em; text-align: left;\">好礼周周送，上海福彩邀你一同感受夏日“热”情！</p>\n<p style=\"text-indent: 2em; text-align: left;\">活动详情请关注上海福彩微信公众号，或致电24099898进行电话咨询。</p>\n<p style=\"text-indent: 2em; text-align: left;\">自2019年5月6日起，上海福彩嘉年华促销活动开展以来，彩民报名踊跃。据统计，活动第三轮（5月20日－5月26日），有效参与抽奖数据电脑票和即开票分别为64173条和21707条。5月29日，在上海市东方公证处现场公证下，上海福彩嘉年华实物营销活动进行了第三轮电脑抽奖。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191464_500x500.jpg\" title=\"1\" alt=\"1\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: center;\"><strong>双色球、3D营销活动中奖名单</strong></p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191465_500x500.png\" title=\"3481240a792a43d48c48e8118d48406c\" alt=\"3481240a792a43d48c48e8118d48406c\" suffix=\"png\"></p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191468_500x500.png\" title=\"4\" alt=\"4\" suffix=\"png\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">活动获奖信息将通过上海福彩网、上海福彩微信平台公布！</p>\n<p style=\"text-indent: 2em; text-align: left;\">第三轮一等奖领奖日期为5月30日-6月6日，每天9:30-15:30（节假日不予领奖），中奖者需携带参与活动的彩票原件及领奖人身份证件原件，至上海市福彩中心兑奖处（上海市黄浦区四川中路321号）办理兑领手续，逾期视为弃奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">二等奖奖品将会以预留的姓名、身份证号和上海行政区域内的收件地址信息，由市福彩中心在活动结束后，于6月中旬安排统一快递配送给中奖者，中奖者注意查收快递信息！</p>\n<p style=\"text-indent: 2em; text-align: left;\">所有奖品逾期视为自动放弃，不予补发！如有疑问，欢迎致电24099898进行咨询！</p>\n<p style=\"text-indent: 2em; text-align: center;\"><strong>即开票营销活动中奖名单</strong></p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191469_500x500.png\" title=\"即开票\" alt=\"即开票\" suffix=\"png\"></p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191470_500x500.png\" title=\"2\" alt=\"2\" suffix=\"png\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">活动获奖信息将通过上海福彩网、上海福彩微信平台公布！</p>\n<p style=\"text-indent: 2em; text-align: left;\">一等奖获奖者，请登录报名界面，在“中奖记录”里准确填写登记信息，并携带登记时的有效身份证件至上海市漕宝路66号光大会展中心B座12楼领取奖品；领奖时间：6月6日至6月21日间工作日（上午：9:00-11:15；下午：13:30-16:45；节假日休息）；逾期未领者视为弃奖；</p>\n<p style=\"text-indent: 2em; text-align: left;\">二、&nbsp;三等奖获奖者，请登录报名界面，在“中奖记录”里准确填写登记信息，确保准确无误，否则奖品无法送达，责任自负；6月13日起，奖品将由专业配送公司配送至登记地址；</p>\n<p style=\"text-indent: 2em; text-align: left;\">四等奖获奖者，请登录报名界面，在“中奖记录”里进行信息登记，登记后可前往本市福利彩票销售网点（地址可到“上海福彩网”www.swlc.net.cn查询），出示券码兑换100元的即开票；兑换的截止日期为6月21日晚20:30，逾期未兑换者视为弃奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">所有奖品逾期视为自动放弃，不予补发！如有疑问，欢迎致电24099898进行咨询！</p>\n<p style=\"text-indent: 2em; text-align: left;\">恭喜以上幸运儿们，同时也感谢广大彩民的广泛关注和积极参与！</p>\n<p style=\"text-indent: 2em; text-align: left;\">在本轮抽奖结束后，活动将继续开展，共计4轮抽奖，每轮同样将送出华为手机、戴森电吹风等实物奖励。按照活动规则，5月27日—6月2日为第四轮抽奖周期，6月5日为第四轮抽奖日，当天将抽出第四期中奖名单，请大家注意手中的彩票的参与抽奖截止时间，逾期未登记者，视为自动放弃本轮抽奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">特别提醒：</p>\n<p style=\"text-indent: 2em; text-align: left;\">电脑票的中奖彩票作为兑奖的唯一凭证，请务必妥善保管，于领奖时同身份证原件一同出示，如电脑票的中奖彩票遗失或损坏，将无法兑奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">明媚初夏，福彩献礼！下一轮的华为手机、戴森电吹风已准备就绪，心动不如行动，快到福彩代销站点购买双色球、3D和猪年即开票扫码参与活动吧！</p>\n<p style=\"text-indent: 2em; text-align: right;\">更多中奖信息请关注上海福彩网</p>', NULL, '上海福彩网', '“福彩嘉年华”第三批中奖名单新鲜出炉', '2019-05-30 11:29:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133978737730125824', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>双色球“相逢二四七 幸运@你”活动首周获奖名单出炉</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">“我中奔驰了？”5月28日下午，重庆福彩“幸运直播间”直播抽奔驰，引得7万网友在线围观。当天下午17：00，奔驰汽车作为压轴大奖被抽出，“幸运直播间”现场连线了中奖彩民王先生（化姓）。接到电话，王先生还有些反应不过来。当时，他正在医院里，母亲刚刚做完手术。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">确认中奖后，电话里的王先生笑了起来。事后，王先生表示，这是自母亲车祸住院后，一个月来，自己第一次感觉到真正的喜悦。据了解，参与此次抽奖活动的笑脸图片共计84824张。与奔驰汽车大奖一起被抽出的，还有200个幸运大礼包（价值200元），中奖名单可前往重庆福彩订阅号、重庆福彩官网进行查看。</p>\n<p style=\"TEXT-ALIGN: center\"><img title=\"重庆1\" alt=\"重庆1\" src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191408_500x500.jpg\" suffix=\"jpg\"></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>一月前开始频繁购彩 “母亲车祸住院，想让生活多点希望”</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">王先生今年50岁，虽然接触彩票多年，但并不经常购买彩票。一个月前，才变得频繁起来。当时，王先生的母亲车祸住院，在外地打工的他，立即赶回铜梁，在病床前照顾。突发的不幸令他心里蒙上厚厚的阴影，“心里觉得很绝望，就想着何不买点彩票，给生活增添点希望。”</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">刚好，医院附近就有一家彩票店，步行只需七八分钟。从此，王先生开始每天都去那里买上几十元的彩票，“也不是为了中大奖，就觉得买着，心里有点盼头。”5月21日下午，买彩票时，彩票店老板告诉他下午17:30-20:00有双色球活动，可以中奔驰汽车。起初，王先生听后不以为意，想着自己该怎么买还是怎么买，管什么活动时间。“但离开后，不知道为什么，我突然有了种要中奖的感觉。”</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">当天活动时间内，王先生再次前往彩票店，花费200元，购买了10张单票为20元的双色球彩票，获得10张“幸运券”。此后双色球开奖日，一到活动时间，王先生都会准时出现在彩票店里。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>用23张笑脸追中奔驰 “平时生活中，我不爱笑”</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">根据活动规则，想要赢取奔驰汽车，需要前往“重庆笑脸”平台，扫描“幸运券”上的条形码，并上传自己的笑脸，才能获得当周奔驰汽车的抽奖资格。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">这样的规则，为难住了王先生。生活中的他，不大爱笑。特别是最近母亲发生这样的事情，他更是无法挤出一个笑脸。第一次上传笑脸时，由于笑脸值过低，王先生的图片未通过“重庆笑脸”平台系统检测，随后又笑了三四次，才成功。慢慢地，他终于掌握了嘴巴的弧度，才变得容易起来，可以一次性通过审核。最终，在双色球“相逢二四七 幸运@你”首周抽奖活动中，王先生共晒出了23张笑脸图片，“但这些笑也只能算强颜欢笑吧。”王先生说。直到5月28日，得知中奖，他才第一次从心底里浮出喜悦，“现在，我估计我能笑一百分。”</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>喜讯来得正是时候 “母亲刚做完手术，听后笑了”</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">喜讯来得正是时候，从天而降的奔驰汽车，不仅让王先生一展笑颜，挥去心头烦闷，还成为了迎接母亲从手术室出来后，最大的惊喜。据了解，得知中奖当天，王先生的母亲刚刚在手术室里历经了六个小时的救治，身体极为虚弱。然而，当他把中奖消息告诉母亲后，母亲却变得精神起来，含笑看着他，喃喃说道：“你这好运气呀，中大奖了。”旁边，留在医院照顾母亲的侄子、侄女听见这话也兴奋得笑了起来。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">王先生透露，自己家庭条件并不是很好，如今在外打工每月收入只有两三千元，希望通过此次中奖，能让一家人过上好日子。</p>', NULL, '重庆福彩网', '重庆铜梁男子23张笑脸“笑出”奔驰汽车！', '2019-05-30 10:33:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133978737755291648', '<p style=\"text-indent: 2em; text-align: left;\">5月10日，福彩3D第2019123期开奖，当期开奖号码是“157”。铜陵市长江西路五松西村福彩第34110028号投注站点一彩民李先生(化姓)中出3D当期单选位选12注、单选100注，因在“3D游戏400万元红包大赠送”营销活动期间，李先生参加了本次活动，又赢得了七千余元的福运红包，共获奖金12余万元!</p>\n<p style=\"text-indent: 2em; text-align: left;\">5月13日上午，幸运彩民李先生来到市福彩中心办理了兑奖手续。据了解，李先生是福利彩票的老彩民，对小盘玩法3D情有独钟，潜心研究3D多年，基本每期都会投注。投注方式也很独特，喜欢先采取复式或位选方式投注，再筛选出自己感觉好的号码进行单选倍投。此次中得12余万的奖金，采取的是“12注单选位选+100注单选”获得!</p>\n<p><br style=\"text-indent: 2em; text-align: left;\"></p>', NULL, '安徽福彩网', '铜陵3D彩民单选投注幸运获奖12万元', '2019-05-30 10:32:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133978737776263168', '<p style=\"text-indent: 2em; text-align: left;\">“说起来挺幸运的，偷懒了一回，却意外与‘幸运之神’来了个亲密接触。”5月20日，在这个充满爱的日子里，出差归来的刘先生（化姓）到淄博市福彩中心领取了一份大礼，那就是双色球第2019055期二等奖368485元，而中奖原因更让人称奇，竟因偷懒多投了一期。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191357_500x500.jpg\" title=\"1\" alt=\"1\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">刘先生玩彩多年，只对“大奖大，小奖多，一个蓝球就中奖”的双色球游戏情有独钟。刘先生在投注方面从不盲目，每期投注金额最高不超过10元，以单式为主。通常情况下，他多采用机选投注，偶尔也会视心情改变策略，对上期号码进行跟投。</p>\n<p style=\"text-indent: 2em; text-align: left;\">谈起本期中奖，刘先生一个劲地说：“幸亏多投了一期，要不然也不可能这么幸运。”这到底是怎么回事？中奖跟多投一期之间有什么联系吗？</p>\n<p style=\"text-indent: 2em; text-align: left;\">进一步交流后得知，原来刘先生因工作原因，经常到外地出差，出差期间难免因工作原因耽误玩彩，于是乎，他每次出差前，都会提前将购彩事宜安排妥当，委托家人或朋友代为购买，中奖这期亦是。“出差期间工作繁忙，难以静下心来选号，就偷懒让家人将上期号码重新投了一遍。”</p>\n<p style=\"text-indent: 2em; text-align: left;\">然而，让刘先生没有想到的是，他因为偷懒多投了一期，却幸运中奖了，而且还是双色球二等奖，奖金高达36万元。每期开奖过后，刘先生都习惯查看开奖公告，而这一次他却被开奖公告给吓了一跳。只因第二注号码中的6个红球号码与当期开奖号码一致。这一发现，让他兴奋不已地马上拿出之前的旧票查看，没错，真的中了二等奖。可转念一想，又有些后怕，一是幸亏自己偷懒多投了一期，二是家人是否购买上彩票。于是刘先生赶紧打电话给妻子，等收到肯定答复后，才松了一口气。</p>\n<p style=\"text-indent: 2em; text-align: left;\">一周后，也就是5月20日，出差归来的刘先生选在这个充满爱意的日子里来领取大奖。问及奖金的使用计划时，刘先生表示，主要用于家庭，改善生活条件，再给孩子存点教育基金,至于自己的这个玩彩爱好，会一如继往地坚持下去。</p>', NULL, '山东彩票网', '复制上期号码 幸运中得36万多元双色球大奖', '2019-05-30 10:09:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1133978737797234688', '<section powered-by=\"xiumi.us\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(51, 51, 51); font-variant-numeric: normal; font-variant-east-asian: normal; letter-spacing: 1px; line-height: 28.8px; text-align: justify; white-space: normal; widows: 1; background-color: rgb(255, 255, 255); overflow-wrap: break-word !important;\">\n <section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">\n  <section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; overflow-wrap: break-word !important;\">\n   <p style=\"text-align: left; text-indent: 2em;\">5月19日晚开奖的双色球第2019057期，福建彩民收获5注单注奖金为22万多元的二等奖，其中2注被龙岩彩民拿下，中奖彩票是一张6+2的复式票，总奖金达44万多元，大奖出自龙岩市新罗区闽西交易城一期阳明楼一层1-1的福彩35071023投注站。5月21日下午，龙岩福彩管理站来了一名兑奖彩民，原来他就是44万元双色球大奖的幸运得主。</p>\n   <p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191333_500x500.jpg\" title=\"微信图片_20190530091405\" alt=\"微信图片_20190530091405\" suffix=\"jpg\"></p>\n   <p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191334_500x500.jpg\" title=\"微信图片_20190530091423\" alt=\"微信图片_20190530091423\" suffix=\"jpg\"></p>\n   <p style=\"text-align: left; text-indent: 2em;\">这名姓郭（化姓）的大奖得主介绍说，他买福彩很多年了，算得上是个老彩民，但他从来不研究号码，也没有固定的购买点，走到哪里就买到哪里，“每期双色球我一般都会买一张7+1的复式票和一张6+2的复式票，7+1的号码是我几年前选的，这几年一直在守号。6+2的号码则是每期变化的，有时是我自己凭感觉随意选，有时就简单地机选。”</p>\n   <p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191335_500x500.jpg\" title=\"微信图片_20190530091427\" alt=\"微信图片_20190530091427\" suffix=\"jpg\"></p>\n   <p style=\"text-align: center; text-indent: 0em;\">中奖彩票</p>\n   <p style=\"text-align: left; text-indent: 2em;\">至于这次中得大奖的6+2复式号是如何选出来的，郭先生轻描淡写地说：“这组号码是我那天随意选出来的，当时看着这组号码感觉蛮舒服的，就买了。”对于因一个蓝球之差而错过超值一等奖会不会感到遗憾，郭先生爽朗地大笑着说：“不会不会，一点都不会，能中2注二等奖我已经很满足了。玩彩票，就是花点小钱买个快乐、买个希望嘛！”</p>\n   <p style=\"text-align: left; text-indent: 2em;\">呵呵，真是个让人钦佩的佛系彩民，一切都随缘！买彩票就要量力而为，不过多地追求大奖，更不无底线地投注，应当在自己条件许可的范围内，买点彩票娱乐一下，给自己带来希望的同时也为国家的福利事业做出贡献！&nbsp;</p>\n  </section>\n </section>\n</section>', NULL, '福建福彩网', '龙岩彩民6+2复式拿下2注双色球二等奖', '2019-05-30 09:24:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134095965125345280', '<p style=\"white-space: normal; text-indent: 2em;\">双色球第2019062期开奖结果：</p>\n<p style=\"white-space: normal; text-indent: 2em;\">红球：07 13 16 23 26 30</p>\n<p style=\"white-space: normal; text-indent: 2em;\">蓝球：01</p>', NULL, '中彩网', '双色球062期开奖结果:07 13 16 23 26 30+01', '2019-05-30 21:29:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134327167195283456', '<p style=\"text-align: left; text-indent: 2em;\">5月30日晚，中国福利彩票双色球游戏进行第2019062期开奖。当期双色球红球号码为07、13、16、23、26、30，蓝球号码为01。当期双色球头奖7注，单注奖金为834万多元。这7注一等奖花落5地，上海1注，江苏3注，浙江1注，湖北1注，新疆1注，共7注。</p>\n<p style=\"text-align:center\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/31/1191706_500x500.jpg\" title=\"QQ图片20190531120131\" alt=\"QQ图片20190531120131\" suffix=\"jpg\"></p>', NULL, '中彩网', '2019062期双色球一等奖中奖明细', '2019-05-31 12:02:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134327167434358784', '<p style=\"white-space: normal; text-indent: 2em;\">5月30日晚，中国福利彩票双色球第2019062期开奖，开出的中奖号码为：红球07、13、16、23、26、30，蓝球01。江苏<span style=\"text-indent: 2em; font-family: inherit;\">省当期喜中3注一等奖，被盐城的一位幸运彩民中得。中奖票售出于盐城市阜城镇清华园小区16幢1#门市编号为32095432的福彩销售点，出票时间为5月30日19点42分41秒。</span></p>\n<p style=\"white-space: normal; text-indent: 2em;\"><span style=\"text-indent: 2em; font-family: inherit;\">这是一张花费336元的自选复式票，共收获3注一等奖、3注二等奖、36注三等奖、81注四等奖、45注五等奖，合计中奖金额2569万多元。</span></p>\n<p style=\"white-space: normal; text-indent: 2em;\">当晚全国除产生7注一等奖外，还开出161注二等奖，单注奖额为18万多元。双色球第2019062期开奖结束后，奖池资金累计68473万元滚入下期，彩民朋友仍有机会2元中得1000万元大奖。</p>', NULL, '江苏福彩', '2569万！盐城彩民独揽3注双色球头奖', '2019-05-31 11:18:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134327167455330304', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">福彩3D游戏玩法简单，投注方式多样，趣味性强，且具备选号难度低、中奖概率高等特点，是一种能经常让彩民朋友享受中奖乐趣的小盘游戏。在玩福彩3D游戏的过程中，几乎每位彩民都有自己的独特方式，有根据试机号来选号的，有选冷号的，有选热号的，有选怪号的……今天，让我们来了解一位“实力”派的3D彩民。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">潘先生是黔东南州台江县的一位中学数学老师，同时他也是一名福彩的铁杆彩民。因为工作原因，只要跟数字有关的他都喜欢琢磨。他说：“从福彩3D游戏上市以来，我就期期不落地投注，应该算是福彩3D游戏的铁粉了。刚开始接触福彩3D时我都是随心选号，中奖自然也是随机的。慢慢地，我琢磨出了适合自己的选号方法，现在隔三差五就中一注，我投注不大，通常控制在20元以内，目的是开心就好。每天动动脑子，用自己的方法琢磨琢磨3D号码，可以让我的脑细胞充分活动起来。”</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">潘老师的选号方法确实很独特。他会把0至9这些数字做成九宫格，但不按照正常排列，而是根据当天的试机号以及“怪数字”来排列0至9在九宫格的对应位置，最后用类似衣架的三角架来杀号，框住的就留下，其他的就排除，一般会剩下6个数字。之后，经验老到的他还会继续杀1至2个号码，剩下的就是当天要投注的数字了。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">选定投注号码，潘老师再经过思考后，才最终决定怎么排列号码。他说，投注福彩3D游戏的过程中，“杀号”是最好玩的，许多彩民朋友一起讨论甚至争论杀号或排列才是福彩3D游戏的“精髓”。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">玩的就是“烧脑”，这是数学老师潘先生玩福彩3D游戏的乐趣所在。</p>\n<p>&nbsp;</p>', NULL, '贵州福彩网', '台江数学老师爱烧脑 琢磨3D游戏成乐趣', '2019-05-31 11:17:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134327167484690432', '<p style=\"white-space: normal; text-indent: 2em;\"><strong>中彩网讯</strong>&nbsp;5月30日晚，中国福利彩票双色球游戏进行第2019062期开奖。<strong><span style=\"color: rgb(255, 0, 0);\">当期双色球红球号码为07、13、16、23、26、30，蓝球号码为01。</span></strong></p>\n<p style=\"white-space: normal; text-indent: 2em;\"><strong>头奖7注834万元 花落5地</strong></p>\n<p style=\"white-space: normal; text-indent: 2em;\">当期双色球头奖7注，单注奖金为834万多元。这7注一等奖花落5地，上海1注，江苏3注，浙江1注，湖北1注，新疆1注，共7注。</p>\n<p style=\"white-space: normal; text-indent: 2em;\">二等奖开出161注，单注金额18万多元。其中，广东（不含深圳）中出36注，排名第一；云南中出16注，排名第二；新疆中出15注，排名第三；<span style=\"text-indent: 28px;\">江苏中出14注，排名第四；</span>北京中出8注，排名第五；此外，其他地区二等奖均低于8注。当期末等奖开出547万多注。</p>\n<p style=\"white-space: normal; text-indent: 2em;\">当期红球号码大小比为3:3，三区比为1:2:3；奇偶比为3:3。其中，红球开出一枚隔码23；两组同尾号13、23和16、26；四枚斜连号16、23、26、30；蓝球则开出01。</p>\n<p style=\"white-space: normal; text-indent: 2em;\"><strong>奖池6.84亿多元</strong></p>\n<p style=\"white-space: normal; text-indent: 2em;\">当期全国销量为3.39亿多元。广东（不含深圳）当期双色球销量为3309万多元，高居第一；浙江以2719万多元的销量位列第二；山东以2075万多元排名第三；江苏以2057万多元排名第四；四川则以1699万多元排名第五。</p>\n<p style=\"white-space: normal; text-indent: 2em;\">计奖后，双色球奖池金额为6.84亿多元，下期彩民朋友将有机会2元中得1000万元。</p>\n<p style=\"white-space: normal; text-indent: 2em;\">（转载请注明：来源中彩网）</p>\n<p style=\"text-indent: 0em; white-space: normal; text-align: center;\">双色球第2019062期开奖号码公告</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/30/1191498_500x500.png\" title=\"QQ图片20190530222547\" alt=\"QQ图片20190530222547\" suffix=\"png\"></p>', NULL, '中彩网', '双色球062期：头奖7注834万 奖池6.84亿', '2019-05-30 22:35:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134515568854958080', '<p style=\"text-indent: 2em; text-align: left;\">5月31日一早，湖北省福彩中心兑奖处刚上班，就走进来十几个人。经询问得知，他们是来兑奖的。</p>\n<p style=\"text-indent: 2em; text-align: left;\">5月30日晚，福彩双色球第19062期开奖。当期全国中出一等奖7注，湖北省一注。湖北省这一注是复式投注，获得一等奖<span style=\"text-indent: 2em; font-family: inherit;\">一注、二等奖一注，奖金总额为856万元，出自荆门市钟祥市福彩第4220053号投注站。</span></p>\n<p style=\"text-indent: 2em; text-align: left;\"><span style=\"text-indent: 2em; font-family: inherit;\"></span></p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/05/31/1191750_500x500.jpg\" title=\"1\" alt=\"1\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>一注大奖，为什么有这么多人来兑奖呢？</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">原来，这注大奖是投注站组织26人合买的，前来兑奖的是26人中的一部分，带队人是投注站业主高先生（化姓）。</p>\n<p style=\"text-indent: 2em; text-align: left;\">高先生说，30日晚10时许，他正在投注站做卫生，一位彩民兴冲冲闯进来说，当天合买的双色球彩票中了大奖。<span style=\"text-indent: 2em; font-family: inherit;\">高先生连忙拿出彩票核对，发现他组织合买的4张8＋2复式彩票中，有一张中了一等奖，他立即将好消息通知了其他人。</span><span style=\"text-indent: 2em; font-family: inherit;\">高先生是3年前开始组织彩民合买的，他认为：“人多力量大嘛！说不准也像其他站点那样，中个大奖回来。”</span></p>\n<p style=\"text-indent: 2em; text-align: left;\">与往常一样，这次的中奖号码是高先生选的。他说，由于每天都在接触彩票，时间久了，多多少少有了一些感觉。每次<span style=\"text-indent: 2em; font-family: inherit;\">合买，他都会凭这种感觉列出几组号码。每次参与合买的人并不固定，谁有兴趣，谁就当场参与、当场付钱。</span><span style=\"text-indent: 2em; font-family: inherit;\">高先生说，这次能幸运中得大奖，可以说是胜在蓝球。当时，他先选了4组8个红球组合。至于蓝球，高先生觉得，当期</span><span style=\"text-indent: 2em; font-family: inherit;\">除3余1的号码应是首选。进一步分析后，他最终选定了01和16。</span></p>\n<p style=\"text-indent: 2em; text-align: left;\">在兑奖现场，高先生就为26位彩民按股分钱了，每位参与的人可分得税后奖金26.3万元。</p>\n<p style=\"text-indent: 2em; text-align: left;\">有彩民高兴地说，感谢高先生给他们带来了大奖，现场分钱好开心。他们希望站点合买能够长期坚持下去，争取能再来<span style=\"text-indent: 2em; font-family: inherit;\">领个大奖。</span></p>', NULL, '湖北福彩', '856万大奖兑奖直击：26人现场按股分钱', '2019-05-31 16:36:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134515568913678336', '<p style=\"text-indent: 2em; text-align: left;\">在5月14日福彩双色球第2019055期开奖日，来自荔湾区的街坊田先生凭借一张10元5注的自选单式票摘得当期一等奖一注，总奖金为1000万元。</p>\n<p style=\"text-indent: 2em; text-align: left;\">中奖第二天一早，田先生便火速来到市福彩中心办理了兑奖手续。近日，田先生再度现身市福彩中心，在领走奖金的同时，富有爱心的他还向广州福彩及时雨关爱基金（以下简称“福彩及时雨”）乐捐8.88万元善款。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>领奖时透露选号方法</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">虽然距离中奖已过去多日，田先生脸上仍挂满了喜悦，他笑嘻嘻地说道：“广州这段时间真是旺得不行，连续中了好几注一等奖，我这几天也在坚持购彩，要是哪天能再撞中一个头奖就更好了！”田先生透露说：“上次有人问我中奖号码是怎么选出来的，其实，这注号码说不上是什么投注技巧，但也算是一种投注方法吧！”随后他压低声音表示，这次中奖彩票上的5注号码是他用生日和平时喜爱的几个数字共同组成的，之所以选择守号一开始仅仅是为了方便投注，不必费尽脑汁选号码。</p>\n<p style=\"text-indent: 2em; text-align: left;\">经过简单而隆重的颁奖仪式，田先生收获税后800万元奖金。在等待领奖时，他查看了福彩及时雨的相关资料，随后主动向工作人员提出向福彩及时雨捐款8.88万元，用于帮助社会上的困难群体。</p>\n<p style=\"text-indent: 2em; text-align: left;\">“我们这代人都是吃苦过来的，现在有能力帮助人，那就能帮一点是一点吧！”田先生也希望“自己的这份爱心能够帮助到最需要的人”。为了表彰田先生爱心善举,市福彩中心随后为其举办了捐赠仪式,并向他颁发了捐赠证书。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>及时雨已筹423万善款</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">据市福彩中心介绍，福彩及时雨关爱基金一直专注“救急解困、雪中送炭”，资助对象多集中在因突遭变故陷入困境的家庭、因罹患重病而无钱医治的儿童，以及生活困难的独居孤寡老人等群体。今年以来，福彩及时雨关爱基金已资助10起案例，他们多是由于突发急危重伤病、需要紧急救治，又无力支付治疗费用，福彩及时雨关键时候伸出援手，为他们撑起了生命的保护伞，托起了生活的新希望。数据显示，福彩及时雨成立于2013年底，6年内共筹集善款423.41万元，资助各类重病患者及困难群体262名，合计314.42万元。</p>', NULL, '信息时报', '广州福彩及时雨添善款 彩民中1000万捐8.88万', '2019-05-31 14:18:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134515568938844160', '<p style=\"text-indent: 2em; text-align: left;\">5月29日晚8点22分36秒，位于衡水市中心街的“中福在线”销售厅传来喜讯，彩民曹先生（化姓）在“连环夺宝”游戏第二关，拍出20颗绿宝石，新运中得一等奖，奖金25万元。在4月份，曹先生曾中得一等奖17万多元。</p>\n<p style=\"text-indent: 2em; text-align: left;\">曹先生透露，中心街“中福在线”销售厅是实实在在的中奖福地，去年有位彩民曾在该大厅中过4次一等奖。该大厅的中奖频率是一个月一注一等奖，自己在4月份中了一等奖，不过可惜的是奖池奖金只有17万多元。29号晚上，曹先生得知该大厅这个月还未中出一等奖时，就跃跃欲试，他有很强烈的预感，自己会再次中奖。果不其然，他参与的“连环夺宝”游戏进行的异常顺利，当屏幕显示出中得25万元大奖的字样时，曹先生兴奋的举臂欢呼，这个月的幸运儿依然是自己。</p>\n<p style=\"text-indent: 2em; text-align: left;\">30号下午，曹先生在中福在线销售厅工作人员的陪同下，来到福彩中心兑奖大厅兑取了中奖支票。这时，曹先生已经平复了激动的情绪，他表示，自己连续两个月都拔得头筹，实在是幸运之极，自己也如愿的中到了一等奖25万元。避免“乐极生悲”，在今后接触“中福在线”的过程中，一定要调整好心态，要保持一颗平常心，理性投注。谈到奖金的安排，他表示要跟全家人好好商量，合理安排，不要辜负幸运之神的眷顾。</p>\n<p><br style=\"text-indent: 2em; text-align: left;\"></p>', NULL, '衡水福彩', '衡水幸运彩民两月连中“中福在线”一等奖', '2019-05-31 14:13:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420754411520', '<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190531/20190531112159911.png\" style=\"width: 600px; height: 450px;\">\n</div> \n<div>\n  　　阳光洒在身上，温暖留在心中。5月30日上午，雨后初晴，欢声笑语荡漾在孝感市陡岗镇沙畈村。当天，孝感分中心的体彩业主一行9人来到孝感市陡岗镇沙畈村，为12名贫困留守儿童圆梦“微心愿”，将书包、文具、球鞋、篮球、电子琴等六一儿童节的礼物一一送到小朋友们手上，帮助沙畈村的12位小朋友实现了自己的小小心愿。\n</div> \n<div>\n  　　当崭新的书包、篮球、漂亮的鞋子和电子琴送到孩子们手上的时候，12位小朋友欢呼雀跃，分外开心。这些小朋友大多数是单亲家庭及留守儿童，父母常年在外务工，最大的愿望是希望爸爸妈妈回家，十分需要关怀和帮助。\n</div> \n<div>\n  　　7岁的杨可欣是一名刚入学的学生，家里生活困难，但她有一个小小的心愿，希望能有一个新书包。12岁的汪斌从孝感90330业主李湘的手中接过篮球的时候不停说着谢谢。他说自己喜欢运动，一直想拥有一个篮球，可是没钱买。今天体彩的叔叔阿姨们帮他实现了久违的心愿，今后一定好好学习，长大后也要做好事、帮助他人。\n</div> \n<div>\n  　　随后，业主们和孩子们做起来抢凳子、老鹰捉小鸡的游戏。瞬间，空旷的场地上荡漾起久违的笑脸，孩子们纷纷表示：很久没有大人陪着自己做游戏，太开心了。\n</div> \n<div>\n  　　体彩业主代表向孩子们提出希望和要求，希望大家要树立远大的理想，为实现理想而努力学习，从现在做起，做一个有文化的新时代少年；要牢记好心人士的帮助，接过爱心棒，做爱心的传递者。\n</div> \n<div>\n  　　公益体彩，乐善人生。本次圆梦“微心愿”活动的业主们共捐赠了2千余元的物品。业主们表示，接下来将持续开展“微心愿”活动，并动员更多业主和销售员参与到微公益中来，一起帮助孩子们实现愿望、温暖童心、点亮希望。（汤敏）\n</div>', NULL, '中国体彩网', '关爱留守儿童 孝感体彩业主圆梦“微心愿”', '2019-05-31 10:56:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420783771648', '<div>\n  　　日前，由体彩公益金资助的深圳市第十五届来深青工文体节棋类挑战赛在银湖会议中心相继举行，众多来深建设者以棋会友，感受“责任彩票”带来的温情关怀。\n</div> \n<p style=\"text-align: center;\"> <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190601/20190601094242185.jpg\" style=\"width: 600px; height: 400px;\"></p> \n<div>\n  　　本届棋类挑战赛的参赛对象是年龄在18岁至45岁、具有深圳社保的来深建设者。其中，围棋赛吸引了40多名围棋爱好者参加，象棋赛参赛选手超过60人。两项比赛经过多轮激战，分别决出一、二、三等奖。\n</div> \n<div>\n  　　本届赛事承办方深圳棋院的工作人员表示，作为本届来深青工文体节的组成活动之一，棋类比赛给广大来深建设者提供了一个切磋交流的机会。青工围棋赛已经连续举办了15年，为广大来深青工搭建了一展棋艺的平台，满足了他们文体娱乐活动的需求，也再次充分体现了对来深青工的人文关怀。\n</div> \n<div>\n  　　近年来，在体彩公益金的大力支持下，深圳市棋类运动蓬勃发展，从校园到社区，从学生到来深建设者，覆盖范围不断延伸，参赛人群不断增加，赛事规模也不断提升，近在身边的体彩公益也让棋类爱好者切身体会到“责任彩票”的温情。（李硅光）\n</div>', NULL, '中国体彩网', '体彩公益金鼎力支持 来深建设者以棋会友', '2019-06-01 09:36:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420808937472', '<div>\n  　　为了推动全民健身，宣传全民健身意识，传承优秀传统文化，带动“体育+旅游+文化”特色产业蓬勃发展，5月25日上午，2019穿越桃花源全民健身·健步行暨“德成杯”中德龙舟友谊赛在桃花源景区盛大开展。\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190530/20190530135946196.png\" style=\"width: 598px; height: 392px;\">\n</div> \n<div>\n  　　本次“健步行”活动共吸引常德各区县（市）、各体育社团及部分游客3000余人。与此同时，中德龙舟友谊赛持续两天，共有德国汉诺威龙舟队及各区县（市）20支队伍700人参赛，比赛分设100米、200米、300米直道竞速三个项目。\n</div> \n<div>\n  　　常德市体彩分中心作为本次赛事的协办单位之一，全体工作人员在开幕式现场开展了一场以“建设负责任、可信赖、健康持续发展的国家公益彩票”为主题的“体彩嘉年华”活动。活动参与人员只需扫描“湖南体彩”公众号二维号，关注后并转发大乐透新规则至朋友圈，即可获得5元顶呱刮即开票一张。常德体彩还开设了两个小型即开票卖场，让大家体验购彩的乐趣。\n</div> \n<div>\n  　　活动一开展，就在现场吸引了大量的群众参与，参与活动的购彩者络绎不绝。常德体彩工作人员积极与群众互动，认真讲解体彩各类游戏的玩法，并宣传中国体育彩票的公益性质。\n</div> \n<div>\n  　　近年来，常德体彩公益活动向“品牌化”“责任化”方向发展，众多品牌赛事背后都有体彩公益金的大力支持，体彩元素成为这些赛事户外沿途和赛场内外的亮丽风景线。通过打造这些群众性、知名的公益品牌项目，体彩公益形象更加深入人心。（杨智）\n</div>', NULL, '中国体彩网', '助力健步行活动 常德体彩开展“体彩嘉年华”', '2019-05-30 13:57:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420829908992', '<div>\n  　　近日，多项群众体育赛事在河南、山东、广东、浙江等地举行，这些赛事都得到了体育彩票的冠名支持。体育彩票在全国统一上市25年来，持续为竞技体育和群众体育的发展筹集公益金，我国的竞技体育和群众体育得到均衡发展，让更多大众“选手”乐享体育比赛。\n</div> \n<div> \n <strong>　　河南：6000人参与城市坐标定向赛</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190530/20190530133951923.png\" style=\"width: 600px; height: 658px;\">\n</div> \n<div style=\"text-align: center;\">\n  参赛选手在体彩网点完成点标任务\n</div> \n<div>\n  　　5月26日，“中国体育彩票·郑州坐标”第五届河南省城市坐标定向赛在河南省工人文化体育中心举行。6000名身着鲜艳服饰的“全民健身宣传员”参赛，将河南省全民健身活动月推向新高潮。\n</div> \n<div>\n  　　本次比赛是一项以郑州市区为赛场，融健身、环保、趣味、文化、益智于一体，参与度高、趣味性强的全民健身赛事。赛事期间，共有跑者风范、亲子路线、拉风造型等12条路线、88个点标。点标单位囊括了郑州市区12个体彩销售网点、8大地标性建筑物和60余处城市景观。\n</div> \n<div>\n  　　河南省社体中心主任陈真表示，河南省城市坐标定向赛是省社体中心重点打造的精品赛事，得到了体育彩票公益金的大力支持，充分体现了“政府主导、体育部门负责、各相关部门协同、全社会共同参与”的全民健身大格局。\n</div> \n<div>\n  　　本次赛事12条线路的供水及终点补水均有河南省体彩中心提供。在作为任务点之一的体育彩票销售网点，选手不仅可免费获得瓶装饮用水，还可免费获赠3元追加投注的体彩大乐透彩票一张或体彩礼品一份。\n</div> \n<div>\n  　　河南省体彩中心还在开幕式现场及两个分会场开展了“你未必光芒万丈，但始终温暖有光”体彩嘉年华活动，花式篮球表演、体彩有奖知识问答、互动游戏等丰富多彩的项目带给参赛选手和广大群众一个健康娱乐的周末。在体彩展台旁，中国体育彩票为参赛选手准备了矿泉水，供参赛选手免费领取。\n</div> \n<div>\n  　　一位参赛选手说：“我非常喜欢中国体育彩票，经常购买体彩，去年定向赛就参加了体彩组织的活动，一会还要去体彩网点完成点标任务。体彩公益金大力支持定向赛，支持全民健身，体彩工作人员还为参赛选手服务，我很感动，我会持续支持中国体育彩票。”\n</div> \n<div> \n <strong>　　浙江：马术联赛在宁波举行</strong>\n</div> \n<div>\n  　　5月18日，由浙江体彩作为公益合作伙伴举行的“中国体育彩票杯”中马协通级赛暨浙江省马术联赛（宁波站）在宁波市宁波天驿马术运动俱乐部举行。来自内蒙古马术协会、大连巡安马术俱乐部、温州凯易路马术俱乐部等8家马术俱乐部的50匹马和88对骑手参赛。\n</div> \n<div>\n  　　本次马术的比赛项目设有盛装舞步和场地障碍两项。盛装舞步比赛采用国际马联第26 版盛装舞步竞赛规则，场地障碍赛比赛采用国际马联第26 版场地障碍竞赛规则。比赛中，马术骑手们足蹬马靴、手持缰绳、纵马驰骋，时而走起“盛装舞步”，时而在马场快速冲刺。现场观赛市民的目光更是紧随着骏马和骑手，时而发出阵阵喝彩。\n</div> \n<div> \n <strong>　　广东：开展救生员职业技能比拼</strong>\n</div> \n<div>\n  　　5月15日，2019年广东省中山市“体育彩票杯”游泳救生员职业技能竞赛在紫马岭全民健身广场游泳馆举行。\n</div> \n<div>\n  　　本次比赛设3个比赛项目和1个展示项目。其中，比赛项目分别为抛绳救生、50米障碍赛和4×25米拖假人团体接力赛；演练展示项目是模拟救生演练，模拟发生溺水事故，整队配合施救。参赛运动员均为中山市在游泳场所从事救生员工作的一线工作者（已经取得游泳救生员国家职业资格证书）。共有来自全市游泳场所8支代表队的近百人参赛。\n</div> \n<div>\n  　　本次比赛得到了体彩公益金的大力支持。据统计，这是自2013年以来，中国体育彩票第七次冠名中山市游泳救生员职业技能竞赛。\n</div> \n<div>\n  　　中山市教体局副局长唐杰伟表示：“培养和建立一支高素质、具有专业技能水平的游泳救生员队伍，是规范游泳场所管理、保障游泳健身资源、保护群众生命安全的重要举措，游泳救生员职业技能竞赛对提高游泳救生员业务素质、更好发挥游泳救生员在群众健身中的安全保障作用具有非常重要的意义。”\n</div> \n<div> \n <strong>　　福建：冠名海峡自行车公开赛</strong>\n</div> \n<div>\n  　　5月12日“体彩杯”厦门集美第八届海峡自行车公开赛暨“萌娃骑集·美乐新奇”滑步车亲子赛在集美区灌口镇正新（厦门）汽车国际文化中心开赛。六十多支车队的近300名来自海峡两岸以及国外的选手同台竞技。\n</div> \n<div>\n  　　“体彩杯”厦门集美海峡自行车公开赛作为福建地区的老牌赛事，已经连续举办了八届（含一届热身赛），参赛选手超过3200名，深得广大车友的喜爱，在国内积累了相当的知名度。今年更有儿童滑步车亲子赛助阵，近200名籍萌娃齐聚赛场，成人赛与儿童亲子赛相得益彰，为大众奉献了一场精彩的骑行活动。\n</div> \n<div>\n  　　赛事设置了男子山地大众、男子山地精英、女子山地公开及骑跑两项体验四个组别，18岁至60周岁不同年龄段均可提前报名参加比赛。儿童组则根据年龄分为2岁至7岁多个组别，每组又分为儿童个人竞赛与亲子赛，现场萌娃齐集，逗趣百出。\n</div> \n<div>\n  　　活动现场，醒目的体彩LOGO吸引着参赛运动员和观众的眼球。体彩公益金为本次活动提供了重要保障和支持。\n</div> \n<div> \n <strong>　　重庆：支持亚洲田径大奖赛测试赛</strong>\n</div> \n<div>\n  　　5月16日至19日，由重庆体彩大力支持的“体彩大乐透杯”2019年亚洲田径大奖赛测试赛暨重庆市青少年田径锦标赛在市奥体中心举行。重庆各区县29支代表队的1178名青少年运动员参赛，项目包括短跑、中长跑、铅球等98个。\n</div> \n<div>\n  　　本次比赛严格执行赛事规程，既锻炼了队伍，又积累了经验，为2019年亚洲田径大奖赛的举办打下了坚实基础。经过激烈角逐，共有10人打破重庆市纪录，沙坪坝区、九龙坡区、璧山区代表队分获总成绩团体前三名。\n</div> \n<div> \n <strong>　　山东：青岛连办两项群体赛事</strong>\n</div> \n<div style=\"text-align: center;\">\n  　　\n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190530/2019053013402605.png\" style=\"width: 600px; height: 450px;\">\n</div> \n<div style=\"text-align: center;\">\n  门球赛获奖选手\n</div> \n<div>\n  　　近日，青岛体彩为大众台球和门球比赛冠名。在体彩公益金的支持下，上述两项活动在当地的普及程度越来越高。\n</div> \n<div>\n  　　5月11日至6月16日，2019年青岛市第五届体育大会台球比赛暨“中国体育彩票”青岛市第十一届“市长杯”台球比赛在当地举行。\n</div> \n<div>\n  　　本次比赛设斯诺克和中式台球两大项，共七个组别，分别是：斯诺克公开组，中式台球的老年公开组、中年公开组、大学生男子组、大学生女子组、青年女子组、青年男子组。来自全市的400余名台球爱好者报名参加。\n</div> \n<div>\n  　　中国体育彩票“市长杯”台球比赛是目前青岛市民参与度最高的台球项目群众性竞技活动之一，赛事门槛低，参与度广，有利于促进全市台球爱好者之间的交流学习，从而推动台球项目的普及推广。\n</div> \n<div>\n  　　5月8日至9日，“体彩杯”青岛市第三十三届“长寿杯”、第二十三届“巾帼杯”门球交流活动在李沧区门球场举行。来自全市十个区市和市老年大学的24支男女代表队的300余名选手参加了交流活动。\n</div> \n<div>\n  　　门球运动是青岛市推广时间较长的老年体育运动项目之一，其中“长寿杯”已经连续举办了三十三届。此次比赛采取分组单循环和同名次决赛赛制，设优胜奖、优秀奖各50%。\n</div>', NULL, '中国体彩报', '体彩公益金鼎力支持 大众选手乐享赛事', '2019-05-30 13:38:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420855074816', '<p style=\"text-align: center;\"> <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190531/20190531102626442.png\" style=\"width: 556px; height: 414px;\"></p> \n<div>\n  　　5月24日，佳木斯市体彩中心门前迎来了众多体彩爱好者。他们把收集的体彩打印纸、体彩即开票等等，制作成精美的图片悬挂在佳木斯市体彩中心门前进行展览，有明星签字的打印纸、有奥运会期间发行的即开型彩票等等。就这一幅幅带有体彩logo的图片引来了许多路过的行人驻足欣赏。\n</div> \n<div>\n  　　他们是佳木斯市彩票收藏联谊会的成员，自发在体彩中心门前组织了这样的活动。李会长指着一幅幅精美的图片说：“这些都是我们的宝贝，我们都视如珍宝。”他轻轻抚摸着展览上自己带来的作品，就象爱惜自己孩子一样。通过和李会长聊天了解到， 佳木斯市彩票收藏联谊会成立于2014年，成员有20多人，平均年龄接近60岁，就是热爱彩票，喜欢彩票上精美图案让他们走到了一起。李会长用简单朴实的话语说：“我们都是退休人员，就是想将自己的宝贝带给大家看看，就是想让更多的人懂它，爱它。”（杨肖红）\n</div>', NULL, '中国体彩网', '小小彩票方寸情', '2019-05-31 10:25:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420876046336', '<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190530/20190530132117190.png\" style=\"width: 600px; height: 400px;\">\n</div> \n<div>\n  　　2019年5月26日，备受关注“粤港澳大湾区第二届龙舟邀请赛”在中山岐江河畔拉开序幕。中山市体育彩票作为赞助商助力本次龙舟赛，现场开展地面推广活动 。\n</div> \n<div> \n <strong>　　规模再创新高</strong>\n</div> \n<div>\n  　　赛龙舟是中山市一项源远流长、深受群众喜爱的传统民俗文化活动，体现了中山人民同舟共济、团结拼搏、奋勇争先的精神。其中“石岐长龙”是省级非物质文化遗产。中山城市建设飞跃发展，岐江河畔成为中山市的一个重要景观，此次龙舟赛就在此河道举行。\n</div> \n<div>\n  　　去年首届粤港澳大湾区中山·石岐龙舟邀请赛参赛队伍、赛事规模创下历史之最。在去年基础上，报名参加今年赛事的队伍数量再创新高。经过层层筛选，第二届龙舟邀请赛共有40支队伍合计近1700名龙舟运动员参赛。其中，“男子长龙（传统龙舟）组”参赛队伍12支、“男子国际龙（22人龙舟）组”参赛队伍20支，“女子国际龙（22人龙舟）组”参赛队伍8支。除粤港澳大湾区全部11个城市外，赛事还吸引了来自汕尾等城市的参赛队伍。\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190530/20190530132144646.png\" style=\"width: 600px; height: 450px;\">\n</div> \n<div> \n <strong>　　严格的比赛规定</strong>\n</div> \n<div>\n  　　秉承公平公开、安全、专业原则，打造专业、高水准的龙舟赛事，共有近70名裁判投入到本届龙舟赛的裁判工作当中。组委会也对参赛运动员身体条件及水性、参赛器材、竞赛办法等均作出了严格规定。譬如本次比赛男子长龙组划姿不限；男、女国际龙22人龙舟组则必须严格采用坐姿划行。值得注意的是，由于男子长龙是采用往返竞速办法，男子长龙到达中转处时，必须拔取对应航道的中转旗。折返中转瞬间，参赛队伍能否恰如其分地提前减速，并一气呵成地完成拔旗、运动员转身调头，成为左右比赛走向的关键。\n</div> \n<div>\n  　　比赛最终由中山无忧净水岐头女子龙舟队、中国国际棒球小镇龙舟队、南下长龙龙舟队分别获得了女子国际龙、男子国际龙、男子长龙（传统龙舟）组的桂冠。\n</div> \n<div> \n <strong>　　中山体彩为赛事添彩</strong>\n</div> \n<div>\n  　　中山体育彩票作为本次活动赞助单位，一直鼎力支持全民健身事业发展。体育彩票公益金的身影无处不在，从场馆场地设施的建造，到健身器材的配建，再到全民健身活动的开展，中山体彩同时注重大众的体验感和参与感，使体育彩票更加接地气、聚人气，在对赛事的“选准”和“办好”上有不少心得。\n</div> \n<div>\n  　　自中山马拉松大赛首届开赛以来，中山体彩都倾力参与，在比赛现场派发体彩奖品、推广体彩文化，2018年成功举办“公益体彩，乐善人生”体育类摄影大赛，用镜头记录体彩公益活动，让社会各界更深入地了解体彩的公益善举。2019年中山体彩又将龙舟纳入视野，这次龙舟邀请赛吸引了数万名群众在岐江两岸观赛,此次进一步加深群众对体育彩票的认识,树立中国体育彩票公益形象,同时充分体现了中国体育彩票“来之于民、用之于民”的发行宗旨，让公益体彩文化真正融入群众生活，提升百姓生活品质，为中山休闲体育的发展态势增色。\n</div> \n<div>\n  　　中山体彩将继续牢记并践行“责任、诚信、团结、创新”的体彩精神，建设公益体彩、民生体彩、责任体彩、诚信体彩，奋力走好体育彩票新征程。（中山体彩）\n</div>', NULL, '中山体彩', '中山体彩大力支持2019粤港澳大湾区龙舟邀请赛', '2019-05-30 13:19:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420897017856', '<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190530/20190530134447757.png\" style=\"width: 600px; height: 817px;\">\n</div> \n<div>\n  　　5月21日，河南信阳购彩者金先生现身省体彩中心，领取1000万元大奖。\n</div> \n<div>\n  　　5月15日，在体彩大乐透第19055期开奖中，金先生凭借一张5注10元投入的单式票，中出1注1000万元一等奖。\n</div> \n<div>\n  　　据金先生介绍，他买体育彩票已经有5年，坚持买大乐透，期期不落地坚持守号，“每期雷打不动就是这5注号码，如果哪天心情不错就再机选5注。”说起这注中奖号码，金先生笑了，“这5注号码是我精心挑选组合而成的，有着特殊意义，中奖的这注号码里有我和老婆的生日。”\n</div> \n<div>\n  　　开奖当晚，金先生通过手机查询知道自己中奖了，“当时感觉还挺平静，但是后来越想越激动！”随后，金先生决定把彩票放好，等心情平复后再去领奖。\n</div> \n<div>\n  　　问及奖金的规划，金先生表示会填补自己的生意。关于买彩票，金先生说：“以前经济条件好的时候经常做一些善事，我一直都相信好人有好报，买彩票也算为公益事业贡献绵薄之力，最重要还是要保持平常心。”\n</div>', NULL, '中国体彩报', '5注10元单式 信阳购彩者中大乐透1000万', '2019-05-30 13:44:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420922183680', '<div>\n  　　7星彩作为上市较早的体彩大盘玩法，拥有一批忠实的粉丝。前不久，来自海南海口的彭先生、陕西西安的王先生，分别现身领走500万元头奖。两位大奖得主均为7星彩的老购彩者，养成了坚持投注的习惯。\n</div> \n<div> \n <strong>　　“奖金先还欠款”海口私企老板中走500万</strong>\n</div> \n<div>\n  　　前不久，海南海口购彩者彭先生现身省体彩中心，领走7星彩500万元大奖。\n</div> \n<div>\n  　　4月23日，在体彩7星彩第19046期开奖中，彭先生凭借一张5注10元投入的单式票，中出1注500万元头奖。\n</div> \n<div>\n  　　彭先生买7星彩已经有四五年。“每期都买，每次都差不多机选10元。”彭先生说，自己是一个体育爱好者，知道发行体育彩票筹集公益金主要用于支持体育公益事业，对体育彩票颇有好感，尤其热衷7星彩玩法。他用坚持购买7星彩的方式来支持体彩公益事业，同时又给自己买一份希望。\n</div> \n<div>\n  　　当期开奖日前一天，彭先生加完班到公司附近的一家体彩店，买了饮料后顺便让销售员机选了7星彩5注号码。对于他来说这个习惯已经保持很久了。没想到，当期开奖后，彭先生买的那张机选票击中1注500万元大奖！“机选一次中了，真是运气到了。”彭先生笑称是自己坚持购彩，迎来的好运气。\n</div> \n<div>\n  　　“这笔奖金来得太及时了，主要用来还欠款，然后继续投入到自己的事业中去。”彭先生说，他目前经营一家公司，经营过程中资金短缺，还有部分欠款，这笔奖金不仅帮他缓解燃眉之急，还有利于进一步拓展他的事业。\n</div> \n<div> \n <strong>　　第一时间告诉媳妇　西安购彩者守号中走500万</strong>\n</div> \n<div>\n  　　5月14日，陕西西安购彩者王先生现身省体彩中心，领走7星彩500万元头奖。\n</div> \n<div>\n  　　5月12日，在体彩7星彩第19054期开奖中，王先生凭借一张5注10元投入的单式票，击中1注500万元一等奖。\n</div> \n<div>\n  　　王先生今年40岁，是个体彩迷，特别喜欢7星彩，习惯采用守号进行投注。这次中奖的7星彩号码正是守了一年多时间中得。\n</div> \n<div>\n  　　王先生说，他买彩票有9年多，喜欢用手机号码作为选号灵感，再编成号码进行投注，“因为7星彩的号码要排序对位，所以趣味性更强。”\n</div> \n<div>\n  　　5月11日晚，王先生陪着媳妇散步回家，路过彩票店买了这张彩票。他说，在这之前，300元的四等奖中过4次，此外没中过啥大奖，但因为喜欢体育彩票，信赖体育彩票的公正性，所以中不中奖都没太在意。\n</div> \n<div>\n  　　王先生说，得知中奖还是非常激动，第一时间就把这个好消息告诉了媳妇。这500万元奖金对他们这个家庭来说是很大一笔钱，能给家人提供更好的生活。\n</div>', NULL, '中国体彩报', '两地购彩者“坚持投注” 各擒7星彩500万', '2019-05-30 13:41:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420947349504', '<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190528/20190528103802168.jpg\" style=\"width: 600px; height: 430px;\">\n</div> \n<div>\n  　　5月12日，吉安市吉州区骡子山公园对面的10174体彩网点走进来一个小伙子，他拿着一张彩票请销售员帮助兑奖。经过兑验，确定排列3中奖5注，奖金5200元。\n</div> \n<div>\n  　　问起中奖经历，这个小伙子非常爽朗，他说，5月11日下班后，回家路过10174网点，于是进去机选了1注排3，并打了5倍。由于平时上班较忙，爱好玩彩票的他从不仔细研究选号。在他看来，中不中奖全靠运气，如果研究选号就能轻松中奖，那就不用出门工作了。他每次去体彩网点购彩，也是利索地打完彩票就走，不与其他购彩者交流。他坦言，之前没想过能中奖，这次得知中奖的一刻，心里非常高兴。可回头想想，大概是自己的这种心态，才能在购彩上自得其乐。（肖馨怡）\n</div>', NULL, '中国体彩网', '吉安市吉州区小伙购买排列3自得其乐', '2019-05-28 10:37:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691420980903936', '<div>\n  　　在5月20日这个充满浪漫寓意的日子里，为表达爱意与祝福，许多人选择发微信红包或购买鲜花秀一秀恩爱。体彩顶呱刮同样以别样的方式，让“520”过得别有意味。\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190528/20190528103550945.jpg\" style=\"width: 535px; height: 758px;\">\n</div> \n<div>\n  　　抚州市金溪县小伙子小李准备5月20日对女友有所表示，他想，何不带女友去体彩网点刮一刮即开型彩票试试运气，说不定还能中大奖，这比微信发红包更有意思。当天傍晚，小李约女朋友来到12805体彩网点，看到网点内的即开票展示柜里摆放着各种精美的顶呱刮彩票，他想，既然是“520”，那干脆买一张5元面值和一张20元面值的即开票，合起来正好代表“520”。对20元面值的即开票，小李的女友挑选了“运”，寓意好运当头。两张彩票均由小李的女友刮，结果在刮“运”这款票时，第一个就刮出了一个888标志，接下来第二个又刮出了一个8，最后这张彩票中奖400元。惊喜加好运让小李和女友特别兴奋，没想到一个随意的想法在“520”这一天变得格外有意义。这是体彩顶呱刮带给了他们好运，相信小李和女友也会说，体彩顶呱刮——“520”！\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190528/20190528103602550.jpg\" style=\"width: 600px; height: 849px;\">\n</div> \n<div>\n  　　5月20日下午，购彩者小章来到抚州市乐安县老烟草公司对面的12705体彩网点，直接购买了4张10元面值的新票“跃龙门”，其中一张中奖200元。业主还向他介绍，新票“跃龙门”和经典老票“点石成金”正在开展活动，从5月10日至6月9日，凡在当地体彩网点购买这两款顶呱刮，中得指定奖级送一定金额的即开票。小章因此多获赠50元顶呱刮即开票，他说：“‘520’给我带来了好运！”\n</div> \n<div>\n  　　同在抚州，同是5月20日，资溪县的宋先生把中得的体彩顶呱刮“跃龙门”奖金5000元给了妻子，以表达节日的祝福。宋先生下班时路过资溪县建设中路69号13107体彩网点，他看到玻璃门上贴着的即开新票“跃龙门”的活动海报，便走进网点，买了10张试手气。刮到第三张时，宋先生刮出了五条龙，他心里一动，感觉会中奖，便赶快刮开奖金区的覆盖膜，结果惊喜地出现，每条龙下面显示的奖金都是1000元，这张10元面值的“跃龙门”中得奖金5000元。\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190528/2019052810361449.jpg\" style=\"width: 600px; height: 919px;\">\n</div> \n<div>\n  　　九江市区的04082体彩网点的即开票一直销售得很好，尤其是顶呱刮有新票推出，会吸引热爱体彩顶呱刮的购彩者抢购。\n</div> \n<div>\n  　　得知5月20日会到活动票，几位购彩者早早就守在店里。顶呱刮即开票一送到，购彩者立刻刮起来。有人喜欢新票，也就有人喜欢老票，大家各有所爱。不一会儿，一位购彩者就刮出一个中了满堂彩的“点石成金”，20次开奖号码都与中奖号码相同，中奖1000元，再加上中得指定奖级送即开票活动，又送出了500元即开票，当场让中奖者乐开了花，他表示，晚上要带家里人出去吃小龙虾。\n</div> \n<div>\n  　　现在，顶呱刮“跃龙门”“点石成金”即开票活动正在进行，如果感兴趣，不妨到体彩网点试试手气。（江彩）\n</div>', NULL, '中国体彩报', '体彩顶呱刮用别样方式“爱”你', '2019-05-28 10:35:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691421006069760', '<div>\n  　　5月16日，东乡区3612012423体彩门店里中得排列3第19129期奖金近21000元，其中包括1注组选和20注直选。\n</div> \n<div>\n  　　中奖的购彩者小陈是一位大乐透爱好者，平时在店里多是购买超级大乐透，当天晚上出门散步，经过体彩门店时，小陈正好把前一天购买的大乐透活动票去兑奖，该张票中得了八等奖15元，小陈看见一旁的购彩者正买着排列3，小陈觉得挺有意思，于是决定试试。\n</div> \n<div>\n  　　在随意的选了三个幸运的号码后，小陈直接投注了20倍40元，并追买了一注组选。这一买不打紧，第二天经过店里的时候，就听到业主叫着告诉他昨天的排列3中奖啦！听到消息的小陈可激动坏了，大乐透中得到的奖金，换来了排列3的一等奖，幸运果然是会传染的！两种玩法都中奖，加起来奖金翻了近百倍。幸运的叠加让小陈非常开心，直言：“真的是太幸运了，中了近21000元，拿中奖的钱，可以来好好研究大乐透，争取再中个一等奖。”\n</div> \n<div>\n  &nbsp;\n</div> \n<p style=\"text-align: center;\"> <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190527/20190527143617513.jpg\" style=\"width: 400px; height: 500px;\"></p> \n<div>\n  &nbsp;\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190527/20190527143631485.jpg\" style=\"width: 400px; height: 500px;\">\n</div> \n<div>\n  &nbsp;\n</div> \n<div>\n  　　好消息接二连三，5月17日，萍乡市光丰铁桥3616016051体彩门店中出排列3第19130期直选10注，中奖者张先生收获奖金10400元。\n</div> \n<div>\n  　　张先生对“排列3”游戏有很深的研究，是一个十足的技术型购彩者。他研究“排列3”游戏有自己独特的方法，每天空闲的时候就在家研究每期的走势图，分析大小与跨度。经过自己缜密地分析之后才最后下注。张先生说，平时购买彩票的时候，自己的感觉来了就多打几倍。主要还是要保持平和的心态，不能光想着中大奖，享受购彩的过程很重要。\n</div> \n<div>\n  &nbsp;\n</div> \n<p style=\"text-align: center;\"> <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190527/2019052714364671.jpg\" style=\"width: 400px; height: 500px;\"></p> \n<div>\n  　　赣州市崇义县的排列3“牛人”吴先生也不甘示弱，购买体彩排列3玩法已有七年之久的他，中得排列3第19127期奖金6413元。\n</div> \n<div>\n  　　5月14日下午，吴先生路过崇义县黑金酒店旁的3606006715体彩门店，购买了当晚开奖的排列3彩票。拿出选好的号码投注了直选和组选共14元，临走加了一注“2、8、0”5倍直选投注。当晚，吴先生就知道了中奖消息，中得排列3直选6倍加组选1注173元，奖金共计6413元。第二天领奖时，吴先生说：“我非常喜欢体彩，也愿意为公益事业奉献一份爱心。”（江彩）\n</div> \n<div>\n  &nbsp;\n</div> \n<p style=\"text-align: center;\"> <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190527/20190527143726560.jpg\" style=\"width: 600px; height: 300px;\"></p>', NULL, '中国体彩网', '幸运会传染 排列3也疯狂', '2019-05-27 14:35:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1134691421031235584', '<div>\n  　　5月13日，排列5第19126期开出奖号18919。江苏宿迁13460体彩投注站购彩者张先生通过守号投注，收获5注10万元大奖，单票擒奖50万元。\n</div> \n<div>\n  　　张先生从2000年开始接触体育彩票，经常光顾13460体彩网点。有一次，他在购买大乐透时看到有人购买排列5，了解到每注中奖金额10万元时，他便想在排列5上试试运气。他用自己的摩托车牌号进行投注，每天1注2元，坚持了近一年都没有中奖，他决定对这注号码略加修改，改投18919。感觉好的时候，他会进行3至5倍不等的倍投。\n</div> \n<div>\n  　　当日，张先生再次投注18919这注号码，并且进行了5倍投注，投注金额10元，结果击中奖号，收获50万元大奖。（宗合）\n</div>', NULL, '中国体彩报', '宿迁购彩者守号倍投中排列5奖金50万', '2019-05-26 10:32:00', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817549303808', '<p style=\"text-indent: 2em; text-align: left;\"><strong>中彩网讯</strong> 6月6日晚，中国福利彩票双色球游戏进行第2019065期开奖。<strong><span style=\"color: rgb(255, 0, 0);\">当期双色球红球号码为06、09、11、15、20、26，蓝球号码为10。</span></strong></p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>头奖10注661万多元 花落8地</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">当期双色球头奖10注，单注奖金为661万多元。这10注一等奖花落8地，北京2注，河北1注，辽宁1注，江苏1注，湖北1注，贵州1注，云南2注，深圳1注，共10注。</p>\n<p style=\"text-indent: 2em; text-align: left;\">二等奖开出317注，单注金额6万多元。其中，江苏中出61注，排名第一；陕西中出42注，排名第二；湖北中出20注，排名第三；重庆中出19注，排名第四；浙江中出16注，并列排名第五；此外，其它地区二等奖均低于16注。当期末等奖开出825万多注。</p>\n<p style=\"text-indent: 2em; text-align: left;\">当期红球号码大小比为2:4，三区比为3:2:1；奇偶比为3:3。其中，红球开出一枚重号20；一组同尾号06、26；两枚斜连号11、26；一组奇连号09、11；蓝球则开出10。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>奖池7.37亿多元</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">当期全国销量为3.27亿多元。广东（不含深圳）当期双色球销量为3171万多元，高居第一；浙江以2641万多元的销量位列第二；山东以2050万多元排名第三；江苏以1942万多元排名第四；四川则以1604万多元排名第五。</p>\n<p style=\"text-indent: 2em; text-align: left;\">计奖后，双色球奖池金额为7.37亿多元，下期彩民朋友将有机会2元中得1000万元。</p>\n<p style=\"text-indent: 2em; text-align: center;\">双色球第2019065期开奖号码公告</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/06/1192832_500x500.png\" title=\"QQ截图20190606223127\" alt=\"QQ截图20190606223127\" suffix=\"png\"></p>', NULL, '中彩网', '双色球065期：头奖10注661万 奖池7.37亿', '2019-06-06 22:36:26', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817683521536', '<p style=\"text-indent: 2em; text-align: left;\">双色球第2019065期开奖结果：</p>\n<p style=\"text-indent: 2em; text-align: left;\">红球：06 09 11 15 20 26</p>\n<p style=\"text-indent: 2em; text-align: left;\">蓝球：10</p>', NULL, '中彩网', '双色球065期开奖结果:06 09 11 15 20 26+10', '2019-06-06 21:27:43', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817712881664', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">近日，广东省福彩中心在官网发布公告，持续近2个月的“幸运双色球，你中奖我买单”促销活动2400万元赠票金已全部派完，活动已于6月4日（双色球第2019064期）圆满收官。据了解，在本次促销期间，广州彩民不仅收获赠票金658万元，还创下了35天内连摘8注双色球一等奖的夺奖纪录。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>活动共送出2617万元赠票金</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">据了解，为回报广大彩民对福彩事业的支持，广东省福彩中心自4月18日（双色球第2019044期）起在全省范围内（不含深圳市）开展了中国福利彩票“幸运双色球，你中奖我买单”活动，针对6种复式投注开展赠票。活动期间，凡以“7个红球+1个蓝球（7+1）、7个红球+2个蓝球（7+2）、8个红球+1个蓝球（8+1）、8个红球+2个蓝球（8+2）、9个红球+1个蓝球（9+1）、10个红球+1个蓝球（10+1）”等六种复式投注（倍数不限）且中奖的，在兑取中奖奖金的同时返还与该张彩票投注金额相等的购票金或等值的双色球彩票。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">活动一经推出便迅速受到全省彩民的追捧，2400万元赠票金额在短短46天内便全部“瓜分一空”。由于本次活动的2400万元赠票金已在6月2日双色球第2019063期使用完毕，根据“活动在资金用完次期销售结束后停止”的规则，活动延后至6月4日双色球第2019064期结束，共额外派出了217万元赠票金。据统计，在本次赠票促销期间，来自广州的彩民收获颇丰，共收获赠票金额658万元，占赠票总金额的25%以上。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>促销期间广州彩民中得8注一等奖</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">据了解，除瓜分到四分之一的赠票金额外，广州彩民在活动开展期间还幸运地中得双色球一等奖8注。4月18日赠票活动启动当晚，来自海珠赤岗的街坊便饮到“头啖汤”，该彩民购买的一张28元的“7＋2”复式票摘得当期一等奖1注，奖金为605万元。时隔5天后，同样是在海珠区，来自同庆路的一位街坊又凭借一张168元的“8+3”复式票摘走了616万元大奖。幸运并未就此止步，在5月7日第2019052期，双色球历史性井喷153注一等奖，成为双色球上市以来头奖注数最多的一期，来自白云区、海珠区、黄埔区的三位彩民分别摘得1注一等奖511万元。随后，5月14日和23日，来自荔湾和越秀区的街坊又分别摘得双色球第2019055期和2019058期一等奖各1注。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">据统计，在上述8注头奖中，除荔湾区长寿东路街坊为单式票中奖外，其余7位中奖彩民均采用了复式投注，可见复式投注正越来越多地受到彩民青睐。其中，来自海珠区赤岗街坊购买的“7+2”中奖票和越秀区百灵路街坊购买的“8+1”中奖票还符合活动赠票条件，在分别领走大奖的同时两位街坊还享受到购票金免单的实惠。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>赠票24日前可兑取 逾期视为自动放弃</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">根据活动安排，符合赠票条件且在兑奖有效期内的彩票最后获取赠票截止时间为2019年6月24日，逾期未领将被视为自动放弃。广州福彩提醒广大彩民朋友：请核对好手中的彩票，如符合赠票资格需凭有效中奖彩票及时领取赠票或彩票购票金。单张彩票的中奖金额在1万元（含）以下的，彩民朋友可凭票到全市任意一间福彩投注站兑奖时领取；单张彩票的中奖金额在1万元以上的，需凭票到广州市福彩中心（越秀区西湖路99号1706室）兑奖时领取。</p>', NULL, '广东福彩网', '广东双色球“你中奖我买单”活动创夺奖纪录', '2019-06-06 14:17:18', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817750630400', '<p>&nbsp;&nbsp;&nbsp; 5月2日，中山一彩民幸运中得2454万元双色球大奖，但一个月过去了，该名大奖得主依然迟迟未露面兑奖，这个千万大奖的最后兑奖日为7月1日，中山市福彩中心提醒广大彩民，要认真核对手中的双色球彩票，以防大奖从身边溜走。</p>\n<p>&nbsp;&nbsp;&nbsp; 据了解，5月2日晚，双色球第2019050期开奖，当期全国共开出13注一等奖，单注奖金为613.6万元，其中中山一彩民幸运收获了其中4注，总奖金高达2454万元。该大奖出自位于中山市东区夏洋村31号的44110501号福彩投注站，经广东省福彩中心检索，中奖彩票为一张8元1注号码4倍倍投彩票，购票日期为5月1日。</p>\n<p>&nbsp;&nbsp;&nbsp; 根据《彩票管理条例实施细则》的有关规定，彩票中奖者应当自开奖之日起60个自然日内兑奖，兑奖期限最后一天为节假日或者彩票市场休市的，顺延至全体公民放假的节日后或者彩票市场休市结束后的第一个工作日，逾期未兑奖的奖金将纳入彩票公益金。因此，这个千万大奖的最后兑奖日为2019年7月1日。</p>\n<p>&nbsp;&nbsp;&nbsp; 由于中出大奖的44110501投注站处于京华商业圈附近，过往人流量较大，因此大奖得主可能仍未得知中奖喜讯。请广大彩民认真核对手中的双色球彩票，同时提醒一下身边的彩民朋友，让这位中奖者在7月1日前到中山市福彩中心办理相关的验票兑奖手续。<br></p>\n<p></p>', NULL, '广东福彩网', '期限过半 中山福彩寻找2454万大奖得主', '2019-06-06 13:52:07', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817784184832', '<p style=\"text-indent: 2em; text-align: left;\">提及双色球彩票，大家都不陌生。该种彩票自上市以来，一直以丰厚的返奖著称，并获得“彩市航母”的美誉。</p>\n<p style=\"text-indent: 2em; text-align: left;\">近日，昆山彩民方先生中得了2019063期双色球二等奖4注，奖金为1178396元。中奖彩票出自昆山市淀山湖镇曙光路56号32055846站点，票面仅8元。中奖者方先生是一位不拘泥于一种投注方式的双色球爱好者。玩彩多年的他，喜欢研究双色球走势图，别人推荐的号码，他有时候也会采用。无论选择哪种投注方式，每期他的购彩金额都不会超过十块钱。</p>\n<p style=\"text-indent: 2em; text-align: left;\">方先生中了大奖后表示十分幸运，会继续支持福彩事业。</p>', NULL, '江苏福彩', '昆山彩民喜获4注双色球二等奖117万元', '2019-06-06 11:32:23', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817813544960', '<p style=\"text-align: left; text-indent: 2em;\">5月17日，福彩3D游戏2019130期开奖，当期开奖号码为：298。马鞍山博望镇一彩民直选倍投150倍，中得150注3D单选奖，奖金156000元，大奖出自于博望镇农行对面的34050191号福彩投注站。</p>\n<p style=\"text-align: left; text-indent: 2em;\">几天后，幸运彩民王先生(化姓)现身马鞍山市福彩中心兑走了奖金。王先生介绍道，他购彩已经有10多年了，各类玩法均有涉猎，但是唯一钟情于3D游戏。他购买3D向来是单选投注，号码的选择就是凭感觉和眼缘。王先生说，当期他在投注站的3D走势图前扫了几眼，觉得“298”这组号码比较“顺眼”，就对其进行了投注。而这一次中出这么多的倍数，也是因为对自己选的号码很有信心，所以干脆倍投150倍，结果这就中出了15万余元的大奖，很开心同时感觉中奖也是在意料之中的。</p>\n<p style=\"text-align: left; text-indent: 2em;\">“该出手时就出手，不要让幸运擦肩而过。”王先生说，“感觉对了就买大点，不过最主要还是要抱着平常的心态去面对购彩这一回事，不能沉迷在购彩里面去，中不中奖最主要还是靠自己个人的运气的。”</p>', NULL, '安徽福彩网', '马鞍山彩民倍投3D豪揽15万元大奖', '2019-06-06 10:59:42', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817842905088', '<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">6月4日下午17:00，接到自己中得奔驰大奖的中奖电话时，林女士（化姓）正在上班，身旁十几名同事认为这是另一次诈骗电话。几天前，林女士曾遭遇了一次贷款电话诈骗，损失金额达1万元，让本就困难的经济雪上加霜。尽管如此，这一次，林女士却斩钉截铁否认道：“不是的！这次是真的！我参加过那个活动。”</p>\n<p style=\"TEXT-ALIGN: center\"><img title=\"重庆1\" alt=\"重庆1\" src=\"http://www.zhcw.com/upload/resources/image/2019/06/06/1192713_500x500.jpg\" suffix=\"jpg\"></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">据了解，5月21日-6月16日，重庆福彩推出双色球“相逢二四七·幸运@你”活动，凡购买双色球单票金额20元（含）以上，投注机出票同时，将随机送出一张“幸运券”。“幸运券”不仅有机会中得4-5000元奖金，还可以参加奔驰汽车、幸运大礼包抽奖活动。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>谷底至巅峰</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>从遭电话诈骗到中得奔驰</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">林女士今年47岁，购彩多年，在一事业单位从事库房管理员工作。对于中得奔驰汽车，林女士的同事们始终不敢相信。又是查询重庆福彩客服电话，又是搜索双色球活动新闻等，才确认是真。他们如此担忧，只因上周星期三，林女士不幸遭遇了电话诈骗，损失一万元。提起这事，林女士心情郁结，“当时经济困难，有人问贷款不，我就信了。”目前，林女士已报案处理。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">从天而降的中奖消息，将林女士心中的阴霾一扫而空。她介绍，自己工资2000元一月，家里经济条件不是很好，因此最近一直情绪低沉、闷闷不乐。“这下终于好了，心情有点激动。”为庆祝，林女士打算请同事们一起吃饭。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>中奔驰汽车</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>她只用了2张笑脸</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">据了解，该中奖电话是重庆福彩“幸运直播间”拨出的，6月4日，双色球“相逢二四七·幸运@你”第二周抽奖活动在“幸运直播间”举行。当期共有72836张笑脸进入到此次抽奖环节，林女士仅用2张笑脸为自己“笑回”了奔驰汽车大奖。直播过程中，工作人员对其进行了现场连线。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">电话里，林女士声音激动，透出浓浓的中奖喜悦，急忙追问如何办理兑奖手续，并分享了中奖感受。引得在线观看此次抽奖直播的几万网友羡煞不已。后来，林女士乐呵呵说道，我一听就知道这是真的，“这个活动自开始后，每期我都参加，一直盼着抽辆奔驰汽车。第一周还遗憾没有中，没想到第二周就中了！”</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">据了解，当期与奔驰汽车大奖一同被抽出的，还有200个幸运大礼包（价值200元），中奖信息可前往重庆福彩微信订阅号与官网进行查看。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>愿再中一辆</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>这辆奔驰给女儿开</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">得知中奖后，林女士又立即前往彩票店，购买了20元的双色球彩票，获得一张“幸运券”。据悉，当天正值双色球“相逢二、四、七·幸运@你”活动日。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">熟练打开“重庆笑脸”小程序，林女士完成笑脸上传，期盼着自己能再次中得大奖，“这辆奔驰汽车，我想拿给女儿开。”</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>活动介绍</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\"><strong>还有50万现金！2辆奔驰汽车！400个大礼包等着你</strong></p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">期期10万元现金奖励，周周一辆奔驰汽车。双色球“相逢二四七·幸运@你”活动正在火热进行。据了解，5月21日至6月16日的双色球开奖日（周二、周四、周日）17:30-20:00，凡购买双色球单票金额20元（含）以上，投注机出票同时，将随机送出一张“幸运券”，金额在0元至5000元不等（中奖金额将直接在“幸运券”上显示）。每期10万元现金奖励，活动12期，总共送出奖金120万元。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">截至6月4日，活动已送出70万元现金奖励，目前，还剩50万元等待领取。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">获得“幸运券”的彩民，无论是否中出现金奖励，都别忘了扫一扫“幸运券”上的条形码。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">根据活动规则，每张“幸运券”上的条形码都有一次机会参与“笑出大奖”抽奖活动，奖品为奔驰汽车A180和价值200元的幸运大礼包。活动期间，重庆福彩每周设有奔驰汽车1辆、价值200元的幸运大礼包200个，彩民只需登陆“重庆笑脸”小程序平台，使用该平台的扫一扫功能，扫描“幸运券”上的条形码，成功晒出自己的笑脸，即可获得当周奔驰汽车（税费由中奖者自行承担）、价值200元礼包的双重抽奖资格。</p>\n<p style=\"TEXT-ALIGN: left; TEXT-INDENT: 2em\">每张“幸运券”只能参加当周的抽奖活动，条形码有效时间为每周日晚24:00前，一经扫描当即失效。抽奖活动将于每周二下午在重庆福彩“幸运直播间”举行，从上周所有参与者中抽取中奖彩民，抽奖过程由公证处进行现场公证。</p>', NULL, '重庆福彩网', '玩双色球传笑脸赢大奖 南岸阿姨获奔驰汽车', '2019-06-06 09:53:33', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817884848128', '<p style=\"text-indent: 2em; text-align: left;\">彩市处处有惊喜，机选也能撞好运。5月28日晚，双色球第2019061期开奖。当期山东省开出的7注二等奖中，有一注被济宁市鲁桥镇彩友豪气收入囊中，单注奖金达32万多元。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/05/1192570_500x500.jpg\" title=\"1\" alt=\"1\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">据悉，此次一举斩获双色球二等奖的林先生（化姓）是幸运宝地37082624号投注站的老彩友，也是双色球的铁杆粉丝。在繁忙的工作之余他常会通过购彩的方式放松身心，调节状态。</p>\n<p style=\"text-indent: 2em; text-align: left;\">“我平时比较喜欢小额单式的投注方式，机选居多，偶尔也凭感觉买上几注，时常会遇上点小惊喜。这次竟然凭10元机选票成功拿下32万奖金，真是出乎我的意料！”林先生满脸喜气地笑着说：“这奖来得真是时候，正计划着和女友去买车呢！能撞上大奖的确是件大喜事，不过我觉得购彩还是要保持平常心，量力而行，理性消费，把购彩当作紧张生活的调剂品就好。奉献爱心能让自己心情愉悦，还能守候一份幸运，不失为一件美事！”</p>\n<p style=\"text-indent: 2em; text-align: left;\">截至目前，今年济宁市已中出双色球一等奖5注，二等奖72注。</p>', NULL, '山东彩票网', '济宁彩友凭10元票击中双色球二等奖32万元', '2019-06-05 14:04:15', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817914208256', '<p style=\"text-align: left; text-indent: 2em;\">进入2019年，厦门中福在线出奖十分火爆，在收获了前5个月的精彩之后，6月1日，厦门莲前销售厅再度传出喜讯，一对夫妻彩民在“连环夺宝”游戏中，以每线&nbsp;20分、5&nbsp;线全投的方式，在游戏的第三关，幸运地拍出24&nbsp;颗红宝石，拿下了25万元大奖。</p>\n<p style=\"text-align: left; text-indent: 2em;\">幸运彩民张先生（化姓）是中福在线的资深彩民，空闲时喜欢到中福在线销售厅玩一玩，消遣娱乐一下。6&nbsp;月&nbsp;1&nbsp;日晚上，张先生参加完儿子的儿童节活动后，来到中福在线莲前销售厅玩“连环夺宝”游戏，放松一下。他的运气不错，几轮下来，累计了不少奖分。之后，张先生的爱人也来到销售厅，兴致当头的张先生邀请爱人也坐下来试一试手气，张太太欣然接受，于是夫妻俩一起开始了游戏。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/05/1192563_500x500.jpg\" title=\"微信图片_20190605134937\" alt=\"微信图片_20190605134937\" suffix=\"jpg\"></p>\n<p style=\"text-align: left; text-indent: 2em;\">又是几轮过后，当游戏进入到第三关后不久，突然间投注机屏幕上出现一片红色的宝石，首尾相连地哗哗落下，张先生高兴地念叨：“多了，多了，这下多了。”等到宝石全部落完，瞬间礼花般爆开，张先生一下子愣住了，直到屏幕上出现“恭喜中得累积奖250000&nbsp;元”的提示后，他才清醒过来，发现自己中了25万元大奖，他再也按捺不住激动的心情，欣喜地喊道：“中了，我中大奖啦！”顿时，销售厅沸腾了起来，旁边的彩民纷纷围过来，一睹大奖的风采，并向张先生夫妻表示祝贺。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/05/1192566_500x500.jpg\" title=\"微信图片_20190605134946\" alt=\"微信图片_20190605134946\" suffix=\"jpg\"></p>\n<p style=\"text-align: left; text-indent: 2em;\">之后在柜台办理退分手续时，张先生夫妻俩依然十分激动，张太太说：“真的很高兴，他一直跟我推荐这个游戏，让我来试试，真没想到能中得大奖，太幸运了，以后我也要来玩！”</p>\n<p style=\"text-align: left; text-indent: 2em;\">如果您想在休闲娱乐的同时享受“家”“乐”“福”式的服务，那就赶快到中福在线销售厅吧！中福在线在为您奉上清爽一夏的同时，还将给您带来惊喜和幸运！&nbsp;</p>', NULL, '福建福彩微信公众号', '厦门夫妻彩民收获中福在线25万元大奖', '2019-06-05 13:55:06', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817935179776', '<p style=\"text-indent: 2em; text-align: left;\"><strong>总奖金高达544万多元</strong></p>\n<p></p>\n<p style=\"text-indent: 2em; text-align: left;\">5月30日晚，双色球第2019062期开奖，当期的开奖号码为红球07、13、16、23、26、30，蓝球号码01，当期全国开出一等奖7注，一等奖161注,广东中出二等奖37注，其中30注由佛山市顺德区第44131121号投注站与第44131164号投注站中出，单注奖金181559元。经检索，佛山市中得的双色球第2019062期二等奖的中奖彩票一张是1注20倍单式的自选票，出票时间为5月30日14点23分，另一张是1注10倍单式的自选票，出票时间为5月30日14点27分。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>中奖站点负责人称是同一个彩民中的</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">开奖当天晚上，佛山市福彩第44131164号投注站负责人梁先生第一时间在微信朋友圈上发中奖信息，称是同一个彩民中的双色球二等奖30注，总奖金高达5446770元。看到微信后市福彩中心工作人员第一时间联系梁先生，梁先生高兴地说：“中奖彩民是我的老顾客，虽然中得的30注二等奖彩票是在二个站点购买的，但二个中奖站点的距离相差不到100米左右，他是先到44131121站点购买了单式20倍后，再到我站点购买了同样的号码10倍”。</p>\n<p style=\"text-indent: 2em; text-align: left;\"><strong>只差一个号码与2亿元擦肩而过</strong></p>\n<p style=\"text-indent: 2em; text-align: left;\">据站点负责人梁先生回忆，该彩民购买福利彩票已有十<span style=\"text-indent: 2em; font-family: inherit;\">多年了，平常多以单式倍投为主，感觉也没有中过什么大奖，但他一直坚持购买双色球，这次只差一个蓝码，要不至少有2亿以上的奖金。当工作人员谈起到目前为止还不见到大奖得主前来领奖，梁先生平静地说：“中奖后第二天，大奖得主就找我要了市福彩中心的详细地址与联系电话，应该最近几天就会过去兑奖”。</span></p>\n<p style=\"text-indent: 2em; text-align: left;\">据了解，2011年佛山市一彩民曾经中得双色球第2011115期二等奖59注，奖金总额高过1300万多元。而这次彩民一人独中双色球二等奖30注，总奖金544万多元，也再次印证了“双色球”游戏巨无霸的地位。</p>', NULL, '广东福彩网', '佛山彩民斩获双色球二等奖30注 总奖金544万', '2019-06-05 13:24:47', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817956151296', '<p style=\"text-indent: 2em; text-align: left;\">6月4日晚，中国福利彩票双色球游戏进行第2019064期开奖。当期双色球红球号码为12、20、24、25、30、33；蓝球号码为12。当期双色球头奖4注，单注奖金为906万多元 。这4注一等奖花落4地，上海1注，浙江1注，广西1注，贵州1注，共4注。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/05/1192541_500x500.jpg\" title=\"QQ图片20190605113457\" alt=\"QQ图片20190605113457\" suffix=\"jpg\"></p>', NULL, '中彩网', '2019064期双色球一等奖中奖明细', '2019-06-05 11:37:59', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817972928512', '<p style=\"white-space: normal; text-indent: 2em;\"><strong>中彩网讯</strong>&nbsp;6月4日晚，中国福利彩票双色球游戏进行第2019064期开奖。<strong><span style=\"color: rgb(255, 0, 0);\">当期双色球红球号码为12、20、24、25、30、33；蓝球号码为12。</span></strong></p>\n<p style=\"white-space: normal; text-indent: 2em;\"><strong>头奖4注906万多元 花落4地</strong></p>\n<p style=\"white-space: normal; text-indent: 2em;\">当期双色球头奖4注，单注奖金为906万多元 。这4注一等奖花落4地，<span style=\"font-family: inherit;\">上海1注，浙江1注，广西1注，贵州1注，共4注。</span></p>\n<p style=\"white-space: normal; text-indent: 2em;\">二等奖开出92注，单注金额22万多元。其中，浙江中出15注，排名第一；广东（不含深圳）中出14注，排名第二；云南中出6注，排名第三；河南、湖南、深圳分别中出5注，并列排名第四。另外，其他地区二等奖均低于5注。当期末等奖开出1073万多注。</p>\n<p style=\"white-space: normal; text-indent: 2em;\">当期红球号码大小比为5:1，三区比为0:2:4；奇偶比为2:4。其中，红球开出一枚隔码30；一组二连号24、25；一组同尾号20、30；两枚斜连号20、30；蓝球则开出12。</p>\n<p style=\"white-space: normal; text-indent: 2em;\"><strong>奖池7.43亿多元</strong></p>\n<p style=\"white-space: normal; text-indent: 2em;\">当期全国销量为3.31亿多元。广东（不含深圳）当期双色球销量为3243万多元，高居第一；浙江以2670万多元的销量位列第二；山东以2024万多元排名第三；江苏以1972万多元排名第四；四川则以1641万多元排名第五。</p>\n<p style=\"white-space: normal; text-indent: 2em;\">计奖后，双色球奖池金额为7.43亿多元，下期彩民朋友将有机会2元中得1000万元。（转载请注明来源中彩网）</p>\n<p style=\"white-space: normal; text-indent: 2em; text-align: center;\">双色球第2019064期开奖号码公告</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/04/1192372_500x500.png\" title=\"QQ图片20190604220708\" alt=\"QQ图片20190604220708\" suffix=\"png\"></p>', NULL, '中彩网', '双色球064期：头奖4注906万多元 奖池7.43亿', '2019-06-04 22:06:35', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690817993900032', '<p style=\"white-space: normal; text-indent: 2em;\">双色球第2019064期开奖结果：</p>\n<p style=\"white-space: normal; text-indent: 2em;\">红球：12 20 24 25 30 33</p>\n<p style=\"white-space: normal; text-indent: 2em;\">蓝球：12</p>\n<p><br></p>', NULL, '中彩网', '双色球064期开奖结果:12 20 24 25 30 33+12', '2019-06-04 21:17:41', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690818014871552', '<p style=\"text-align: left; text-indent: 2em;\">广东福彩于4月18日（双色球第2019044期）起在全省（不含深圳市）范围内开展“幸运双色球 你中奖我买单”赠票营销活动，本次活动共安排2400万元赠票资金，截至6月2日（双色球第2019063期），符合赠票条件的彩票总赠票资金已达2489万元，根据活动规则，“幸运双色球 你中奖我买单”赠票活动将于下期结束。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>2400万元赠票仅用46天全部“派光”</strong></p>\n<p style=\"text-align: left; text-indent: 2em;\">“幸运双色球 你中奖我买单”活动一经推出后迅速受到热烈追捧，广东彩民仅用了46天将2400万赠票金额全数“瓜分一空”。因本次活动资金已于2019年6月2日双色球第2019063期使用完毕，根据活动规则，如符合赠票条件的彩票总赠票资金在本次活动期内使用完毕，则活动在资金用完次期销售结束后停止，本次活动结束。因此，本次“幸运双色球 你中奖我买单”赠票活动将于2019年6月4日双色球第2019064期销售停止后结束。</p>\n<p style=\"text-align: left; text-indent: 2em;\"><strong>6月24日为最后赠票兑取日期</strong></p>\n<p style=\"text-align: left; text-indent: 2em;\">因市场反应强烈，购彩者参与度远远超出举办方预期，本次活动比预期提前半个月结束，广东福彩中心提醒购彩者：请核对好手中的彩票，如符合赠票条件且在兑奖有效期内的彩票最后获取赠票截止时间为2019年6月24日，请符合赠票资格的中奖购彩者凭有效中奖彩票及时前往福彩投注站领取，逾期未领视为自动放弃领取该赠票或彩票购票金。</p>', NULL, '广东省福利彩票发行中心', '广东福彩双色球赠票营销活动于今日结束', '2019-06-04 16:21:36', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690818040037376', '<p style=\"text-align: left; text-indent: 2em;\">5月30日，双色球第2019062期开奖，开出红球07、13、16、23、26、30，蓝球01。当期开出二等奖161注，单注金额18.1万多元，常州一彩民通过复式投注中得奖金18.5万多元。</p>\n<p style=\"text-align: center; text-indent: 0em;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/04/1192355_500x500.jpg\" title=\"201906040331025205\" alt=\"201906040331025205\" suffix=\"jpg\"></p>\n<p style=\"text-align: left; text-indent: 2em;\">据了解，该大奖出自新北区新桥郭塘街32040818福彩站点。中奖者是一位中年彩民，对双色球游戏喜爱有加，平时空闲自己也会研究号码走势。双色球第2019062期开奖日傍晚，他来到站点投注了一组复式号码，核对当晚的开奖号码，中得1注二等奖、18注四等奖，45注五等奖，共收获奖金18.5万多元。</p>\n<p style=\"text-align: left; text-indent: 2em;\">中奖彩民表示，自己是福彩的老彩民了，对双色球投注也有一些自己的心得，这次的号码就是自己选的，能够中奖非常开心，会妥善使用这笔奖金。6月3日，该彩民来到市福彩中心兑奖处顺利兑取了奖金。</p>', NULL, '江苏福彩', '常州老彩民喜中双色球二等奖18万余元', '2019-06-04 16:12:53', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690818061008896', '<p style=\"text-align: left; text-indent: 2em;\">福彩“15选5”第2019140期开出号码：03、11、12、13、14，一组四连码在时隔13期后再次开出，当期开出特等奖117注、一等奖117注、二等奖4832注。无锡彩民赵先生凭自选的5注各2倍的彩票，包揽全部奖项，收获奖金1万元。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/04/1192300_500x500.jpg\" title=\"201906041150284088\" alt=\"201906041150284088\" suffix=\"jpg\"></p>\n<p style=\"text-align: left; text-indent: 2em;\">赵先生年过五旬，平时闲暇时间较多，经常到家附近的五洲国际工业博览城1-109号32020419福彩投注站买些彩票。中奖当天，他像往常一样来到这家投注站，先在走势图前研究了一番，发现上期开出的号码整体偏小。于是他在下一期选择了几枚大号，并从上期的开奖号码中选择了11作为落号，组成03、11、12、13、14这注号码。投注时，赵先生犹豫了一下。因为这是一组四连码，经查询历时开奖号码已经有13期未开出了，为了增大中奖率，赵先生又多选了4注投注号码。</p>\n<p style=\"text-align: left; text-indent: 2em;\">当晚开奖后，赵先生乐开了花。由于当期开奖号码开出四连码，他所投的5注号码中第四注中得2注二等奖，第五注号码中得了2注特等奖和2注一等奖，共计收获奖金1万元。</p>', NULL, '江苏福彩', '无锡彩民命中“15选5”四连码获奖1万元', '2019-06-04 13:45:35', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690818094563328', '<p style=\"text-align: left; text-indent: 2em;\">5月27日晚，福彩“15选5”玩法第2019140期开奖。值得一提的是，自5月14日中奖号码开出“四连号”后，时隔12期，该期中奖号码再次爆出“四连号”，意味着该期中奖彩民可以兼中兼得特等奖和一等奖。</p>\n<p style=\"text-align: left; text-indent: 2em;\">六安幸运彩民马先生(化姓)收获了这份好运。他以一张当期自选倍投彩票，喜中10注特等奖，10注一等奖，奖金总计50350元。</p>\n<p style=\"text-align: left; text-indent: 2em;\">据了解，马先生是福彩铁杆彩民，有着10余年的彩龄，熟悉福彩各类玩法，对15选5玩法更是情有独钟，几乎每天都会买上几注，喜欢在一定时期选择“四连号”作倍投投注。此次中奖号码的选择便是如此。</p>\n<p style=\"text-align: left; text-indent: 2em;\">中奖当天下午，马先生路过位于金安区横塘乡镇的第34130079号福彩站点，看了会“15选5”近期开奖号码走势图，精心挑选了5注较相似的号码后，便对其中1注进行20倍的投注，其余4注进行10倍的投注。27日晚，马先生准时坐在电视机旁收看开奖直播，令马先生出乎意料的是，屏幕上公布的开奖号码“03、11、12、13、14”，与他所投注的第四注号码一模一样。马先生在得知自己喜中15选5玩法特等奖时，激动的心情溢于言表。</p>\n<p style=\"text-align: left; text-indent: 2em;\">第二天一早，马先生来到六安市福彩中心办理兑奖手续。谈及中奖经历，马先生激动地说到：“一直期待着“四连号”的出现”，可以中得更丰厚的奖金，没想到好运这么快就降临在自己身上。”</p>', NULL, '安徽福彩网', '六安幸运彩民喜中福彩“15选5”大奖', '2019-06-04 11:23:56', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690818119729152', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 今年以来，临夏视频票彩市频传喜讯。此次中奖的彩友蒋先生可谓是锦鲤附体，这是继他三个月前爆机后，再次夺得中福在线大奖，使得临夏市中福在线全国累积大奖迅速刷新达到6个。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 蒋先生是刚接触视屏票不久的新彩民，刚开始接触中福在线是由于工作压力大，想以此来娱乐放松自己的。闲暇时，他便会到这里来放松一下紧张的情绪，让精神得到短暂的释放。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5月26日下午3点多，在红园路附近办事的蒋先生刚好路过红园路销售厅，三个月前爆过机的他希望还能再次收获幸运，便走进了销售厅。当时销售厅里人气很旺，大部分投注机已经被占满，只有寥寥几个投注机空着，他就随机在3号机前开始了“连环夺宝”游戏。蒋先生记得当时3号机的前一位彩民已经中出了10万分，却不知为何放弃了，他以每注200分共5注的投注方式继续投注。当游戏进入到第三关的时候，屏幕上刷刷的落下25颗红宝石连成一片，随即“恭喜中得累积奖110000元”的提示瞬间在屏幕中央显现出来，有了一次中奖经历但又不敢确定再次能获奖的他疑惑地自言自语：“难道又中了吗？”这时旁边的彩友已经按耐不住兴奋：“爆机了！你爆机了！”其他彩友听到后，纷纷跑来见证这重要的时刻，顿时整个销售大厅一片欢呼喝彩声。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 说到中奖是否靠技巧，蒋先生说自己只是为了娱乐减压，因此也没有什么投注技巧心得，一般会凭感觉。办完兑奖手续的蒋先生表示非常感谢在背后默默支持他关注公益事业的家人，同时也表示，以后还会继续支持福利事业，为社会贡献自己的绵薄之力。</p>\n<p></p>', NULL, '甘肃福彩网', '临夏幸运彩民时隔三个月再获全国累积奖', '2019-06-04 10:09:12', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690818136506368', '<p style=\"text-indent: 2em; text-align: left;\">买彩票这件事，在小编看来一直是：彩票还没有开奖，却早已控制不住内心那种中彩票的幻觉。“保守地讲，咱感觉这次至少是个二等奖。可惜结果是，每次开奖后都会完美地错过开奖号码。”原来，一生中最擅长的事不是中奖，而是做梦。即便自己不中奖，但不得不承认，确实有“幸运儿”被幸运女神眷顾着……</p>\n<p style=\"text-indent: 2em; text-align: left;\">5月9日晚，双色球第2019053期开奖中，济南市槐荫区外海花园桂雨苑001号第37011273号投注站传来中奖喜讯，该站一位老彩友齐先生（化姓）喜中一注双色球二等奖，单注奖金133437元。由于他采用的是“红球复式”投注，除了这注二等奖，还揽中了12注四等奖，15注五等奖，揽获28注奖项，奖金共计135987元。</p>\n<p style=\"text-indent: 2em; text-align: left;\">提及“守号”和“机选”，不少彩友联想到的是双色球“单式彩票”。但是，这两项并非是单式彩票的专利。咱济南的这位齐先生，就凭借机选的一组红复式双色球彩票，赢得的这注二等奖。“这是我投注以来中的最高的奖金了！”齐先生笑着告诉工作人员。随后，他又补充道，“其实在这之前，我已经忘记投注五六期，幸好这期号码咱跟上了，要不然就无缘大奖了！”这组号码是在1273号福彩站点机选的。最初他只是机选的这组56元的复式彩票，虽然是机选，齐先生对号码的要求依然是精之又精。他还清楚地记得，当时的选号，至少更换了八组号码。</p>\n<p style=\"text-align:center;\"><img src=\"http://www.zhcw.com/upload/resources/image/2019/06/03/1192089_500x500.jpg\" title=\"1\" alt=\"1\" suffix=\"jpg\"></p>\n<p style=\"text-indent: 2em; text-align: left;\">虽然齐先生拥有十年的彩龄，但与期期不落的老彩友相比，齐先生表示自愧不如。因为工作关系的原因，他经常出差在外，所以买双色球彩票的时间和地点也比较随性。5月8号这天，从外地回来的齐先生，在路过1273号福彩站点时，恍然发现已经很久没买双色球彩票了，虽然当天并非是双色球开奖日，齐先生还是走进去将之前购买的彩票号码进行了投注。结果在第二天晚上的双色球第2019053期开奖中得知，红球号码开出：“04、16、22、25、29、31”蓝球号码开出：“08”。让他感到意外的是，这期购买的双色球彩票红球号码全部选中，因此他成为当期济南唯一的一注双色球二等奖中奖者。</p>\n<p style=\"text-indent: 2em; text-align: left;\">双色球的魅力就在于此，<span style=\"text-indent: 2em; font-family: inherit;\">只要你参与了，</span><span style=\"text-indent: 2em; font-family: inherit;\">就有可能遇见属于你的幸运！</span></p>', NULL, '山东彩票网', '“8+1”复式票击中28注奖项 揽获13万多元！', '2019-06-03 14:36:57', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690818157477888', '<p style=\"text-indent: 2em; text-align: left;\">5月30日晚， 福彩双色球第2019062期开出的中奖号码为：红球07、13、16、23、26、30；蓝球01。当期全国开出7注一等奖，单注奖额为834万元。其在这七注一等奖里，有三注被盐城市阜宁彩民幸运独揽，斩获2502万元。</p>\n<p style=\"text-indent: 2em; text-align: left;\">该中奖票售出于阜宁县清华园小区16幢1#门市32095432投注站，投注方式为8+2复式票3倍方式投注，刷新了当地彩票市场的最高中奖纪录。</p>\n<p style=\"text-indent: 2em; text-align: left;\">据中奖彩票销售员回忆，中奖人是位老彩民，开始都是单选，后来在销售员推荐下，增加了复式倍投投注，平时也会研究走势图，参考一些推荐号，然后根据自己的想法组合一套中意号码。</p>\n<p style=\"text-indent: 2em; text-align: left;\">他一直坚持购买双色球，这么多年来，几乎是期期都不落下。在购彩方式上，他购彩不拘泥于方式，以机选和自选相结合。在购彩习惯上，都是在当天开奖前投注，先是在家里把号码编好后，然后到投注站购买。</p>\n<p style=\"text-indent: 2em; text-align: left;\">最近江苏福彩中心开展复式投注中奖返本金活动，他都是以自选复式投注为主，每次都能中奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">中出3注大奖当天晚上他感觉特别好，对蓝球01号情有独钟，于是加大了倍投。让他没想到的是，幸运居然迅速降临，因为选择了复式倍投，最终收获了大奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">也是在5年前的2015年5月份，阜宁彩民就是以双色球复式投注中得655万元后，沉寂到现在，一直未中出双色球大奖。</p>\n<p style=\"text-indent: 2em; text-align: left;\">尽管32095432站点地理位置稍微偏僻但是挡不住幸运女神的光顾。自此双色球千万巨奖的诞生，将会掀起阜宁福彩市场的新热潮，扩大福彩双色球品牌影响。</p>', NULL, '江苏福彩网', '盐城阜宁彩民独揽3注双色球头奖 奖金2502万', '2019-06-03 14:14:43', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821412257792', '<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609092749180.jpg\" style=\"width: 550px; height: 400px;\">\n</div> \n<div>\n  　　6月7日、8日，录取吧！每年高考季，美好的祝福成批量涌向高考学子，许许多多爱心人士也主动加入到为高考保驾护航的行列。\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609092803282.jpg\" style=\"width: 550px; height: 400px;\">\n</div> \n<div>\n  　　咱们可爱的湖北体彩人，突然停下了平日里习惯性的“叫卖声”，以实际行动为考生营造一个清净的考试环境。神农架体彩人盼了14年，好不容易盼来一个752万元的大乐透大奖，本可以借机大张旗鼓地宣传一下，敲锣打鼓游游街什么的，可是孩子们面临高考，不能闹出任何声响来影响他们，大家于是决定：除了在网点悄悄张贴喜报，其他有声响的庆祝活动一律取消。\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609092815936.jpg\" style=\"width: 550px; height: 400px;\">\n</div> \n<div>\n  　　高考开始了，交警、环卫、城管等各司其职，咱们可爱的湖北体彩人虽然没有“官宣”的职责，但他们也主动自发地当起了义工和志愿者，尽心尽力为高考学子和家长们服务。洪湖市的数十名体彩销售业主开起私家车，自发组成爱心车队，为考生和家长提供免费接送服务；襄阳体彩人在考点周边允许的范围内，采购来成堆成堆的矿泉水，免费为考生和家长送清凉；其他地区的体彩工作人员和销售点业主，也纷纷以送清凉、送祝福等方式，参与到高考服务大合唱中来，表达作为一名体彩人的心意，也收获了考生家长和网友们的一致点赞。\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609092827722.jpg\" style=\"width: 500px; height: 500px;\">\n</div> \n<div>\n  　　公益体彩，乐善人生！好样的，湖北体彩人，你们在高考期间的爱心与担当，就是体彩人在“公益考场”里交出的一份最好答卷！（胡蓓）\n</div>', NULL, '中国体彩网', '高考服务大合唱 湖北体彩义工获点赞', '2019-06-09 09:27:32', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821445812224', '<div>\n  　　\n <strong>诚信为本一诺千金</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609124025293.jpg\" style=\"width: 500px; height: 500px;\">\n</div> \n<div>\n  　　赣州市06138体彩网点业主袁胜平在经营体彩的8年里，始终坚持做好彩票销售服务工作。“作为中国体育彩票的销售人员，我很荣幸！”从2012年营业至今，袁胜平凭着坚持与热爱，用实际行动诠释了“公益体彩，乐善人生”的理念，并在今年获得江西体彩颁发的“五星级门店”荣誉。\n</div> \n<div>\n  　　多年来，袁胜平非常注重网点经营环境的改善，在日常工作中，严格按照体彩中心的要求执行。他每天保持网点内卫生整洁，及时更新开奖公告；当有顾客进门便先倒上一杯水；根据当日开奖玩法，把销售终端页面调整好；提前做好走势研究，做到心中有数；备足充值和兑奖资金，让购彩者没有后顾之忧。\n</div> \n<div>\n  　　经营体彩诚信为本。在经营体彩网点的8年里，袁胜平捡到过不知多少手机、钱包、中奖彩票……这些都物归原主。有一次，一位偶尔来玩竞彩的购彩者在网点买完彩票后遗落了一个背包，后通过电话联系到袁胜平，并表示包内物品隔天着急用。袁胜平答应对方一直守在网点，直到深夜2点，那位购彩者才来取包。“我答应别人的事情，就一定要兑现承诺。这位购彩者非常感动，从那以后，他就成了我这里的常客。”\n</div> \n<div>\n  　　通过用心经营和不断努力，袁胜平结识了各行各业的朋友。“在店里坐一坐聊一聊，大家就能成为朋友。彩票一出就走人，多没人情味儿，打个招呼也是好的，我不只是彩票销售员，更是大家的朋友。”能聊爱聊的袁胜平很受购彩者喜欢，有人到网点，不是为了投注，而是同他聊天。不少人对他的评价是：网点气氛很轻松，业主待人很亲切。\n</div> \n<div>\n  　　大家的称赞和喜欢，是袁胜平的骄傲。除此之外，他还有另一份骄傲，那就是公益。“彩票销售是公益事业，我在生活中会坚持做公益。”每年6月7日是高考的时间，袁胜平会参加高考爱心车队，免费接送考生，他说：“作为一名体彩人，我有义务为社会献出自己的爱心，为考生的梦想助力。”袁胜平表示，今后还会参加更多的社会公益活动，以体彩人的身份为社会公益事业作贡献。袁胜平常对别人说：“体育彩票销售是公益事业，我会一直干下去！”\n</div> \n<div>\n  　　\n <strong>钻研业务注重环境</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609124101934.jpg\" style=\"width: 600px; height: 400px;\">\n</div> \n<div>\n  　　同在赣州，南康区夜市南街06305体彩网点是一家经营了10年的老店。因地处商业街附近，客流量大，每天到网点的购彩者络绎不绝。\n</div> \n<div>\n  　　06305体彩网点内宽敞明亮，按游戏划分了购彩区域，墙上除了整齐的走势图，还有不少中奖宣传彩票，营造出浓厚的购彩氛围。去年，该网点销量位列南康区第一名，荣获江西省体育彩票管理中心颁发的“三星级门店”荣誉。\n</div> \n<div>\n  　　自开业以来，经过业主黄志军的努力，网点的生意逐渐红火，销量也稳居南康区前列。其他网点的业主前来学习取经，黄志军总是谦虚地说：“首先要感谢体彩中心的长期支持，我会抓住每年的营销活动发展新客户。后续服务工作也非常重要，我对体彩游戏玩法技巧掌握比较熟练，对感兴趣的购彩者，我会不厌其烦地指导，久而久之，网点培养了一大批忠实的技术型购彩者，销量因此有了保证。”据了解，黄志军经营体彩网点初期，每天会花时间了解体彩各类游戏玩法，积极参加中心举办的各类培训，学习如何经营、如何同购彩者建立信任。\n</div> \n<div>\n  　　对于体彩网点的经营，黄志军一直奉行以诚待人，这让他获得了很多购彩者的认可与信赖。黄志军说：“几年前，我非常幸运地参加了大乐透看开奖活动，在北京亲眼见证了大乐透游戏开奖全过程。作为体彩销售员，亲身感受到开奖的公平、公正和公开，通过自己的所见所闻传达给购彩者，打消他们的顾虑，让大家参与其中，从而提升体彩品牌形象。”\n</div> \n<div>\n  　　无论何时走进06305网点，总能看到黄志军的笑脸，感受到他热情周到的服务。日复一日地忙碌着体彩事业，黄志军也从中获得了快乐。对于能被评选为“三星级门店”，他表示：“很感谢体彩中心，是体彩改变了我的生活，同时让家庭多了一份稳定的收入。”对于未来，黄志军说：“当然希望网点的生意越来越红火，也希望购彩者能中大奖，赢得好运，我会继续做好销售服务工作，为体彩公益事业贡献力量。”\n</div> \n<div> \n <strong>　　平凡岗位不凡人生</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609124130778.jpg\" style=\"width: 600px; height: 400px;\">\n</div> \n<div>\n  　　萍乡16211体彩网点位于上栗县浏万路38号，店面虽不大，但人气很旺，并连续多年销量稳居上栗县前列，多次被体彩萍乡分中心评为优秀门店，今年又被江西省体彩中心授予“四星级门店”。\n</div> \n<div>\n  　　网点业主欧阳辉萍经营体彩十几年，从当初的便利店到现在的专营店，该网点长期保持环境整洁，并时常更换设施。环境好了，整洁了，购彩者自然愿意到这里购彩，这也是欧阳辉萍长期坚持的经营理念之一。\n</div> \n<div>\n  　　除了营造舒适的购彩环境外，欧阳辉萍诚信经营的品格也受到大家认可。\n</div> \n<div>\n  　　据欧阳辉萍介绍，有些购彩者想买彩票，又赶时间，就把钱留在网点让他帮忙购买。“这是顾客对我的信任，这种信任不是一朝一夕建立的，而是通过长时间交往，和我们对购彩者的真诚服务，慢慢建立起来的。”欧阳辉萍说，常有购彩者留下钱让他帮忙出票，在这些购彩者中，不乏中奖者。\n</div> \n<div>\n  　　购彩者小张常说：“在欧阳的网点能享受周到的服务，家庭事业上有什么不顺心，他也会帮忙排忧解难，这就是我只到他网点购彩的原因。”（江彩）\n</div>', NULL, '中国体彩报', '诚信经营展现体彩非凡魅力', '2019-06-09 12:36:56', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821475172352', '<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609122525132.jpg\" style=\"width: 600px; height: 400px;\">\n</div> \n<div>\n  　　竖起的一个大拇指，并拢的另外四个手指，共同构成了由红、蓝、绿、黄、黑五种色调描绘的主视觉图案，再加上图案左边醒目的“顶呱刮”三个汉字———没错，这就是即开型体育彩票顶呱刮的品牌标识———一个看上去正在为什么点赞的“大拇指”。\n</div> \n<div>\n  　　那么，这个“大拇指”到底在为谁点赞？\n</div> \n<div>\n  　　为公益点赞。自2008年全国统一发行至今，顶呱刮通过累计超过1653亿元的发行量筹集了超过332亿元的公益金，为公益事业和体育事业作出重要贡献。2008年7月1日至2010年12月31日，顶呱刮中央集中部分公益金全部用于支援汶川地震的灾后重建，筹集资金达38.3亿元，这个“大拇指”也因此被誉为“赈灾彩票”。\n</div> \n<div>\n  　　为责任点赞。即开型体育彩票的发展，离不开体彩销售网点从业者的辛勤付出。体育彩票全国统一发行25年来，特别是顶呱刮上市11年来，体彩即开票销售队伍中的敬业奉献者、诚信守德者、公益践行者大量涌现，向全社会展示了体彩精神的风貌。\n</div> \n<div>\n  　　为创新点赞。即开型体育彩票在其发展历程中，不断与时俱进，推陈出新。在印制工艺上，在票面主题上，在兑奖方式上，顶呱刮屡出新举，为丰富我国彩票游戏产品结构、方便购彩者的实际需求进行着全方位的努力。\n</div> \n<div>\n  　　体彩顶呱刮———这个大拇指，看上去确实很赞！（戴新）\n</div>', NULL, '中国体彩报', '彩市新语：这个大拇指在给谁点赞', '2019-06-09 12:25:04', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821512921088', '<div>\n  　　俗话说，做一件好事不难，难的是做一辈子好事。\n</div> \n<div>\n  　　作为一名体彩销售人员，孙明忠的日常工作很忙也很紧张。经常买彩票的购彩者都知道，打错一个号码，就有可能错失大奖，而体彩销售人员的工作主要就是“打号码”，而且一个都不能错，因而需要精神高度集中。此外，他们还要帮助购彩者检查“废票”，以免漏掉奖金；招呼客人看护好贵重物品，以免遗失；打扫好店面卫生，给大家提供一个舒适的环境……\n</div> \n<div>\n  　　每天都把这些工作做好，不出差错，就已经不简单了。而孙明忠不仅做好了这些，还做得更多。\n</div> \n<div>\n  　　寻找失踪人口是一件紧急而又费力的事，如果在走失的24小时之内找不到，寻找难度就会更大，尤其是未成年的孩子和失能的老人。孙明忠因为受到过别人的帮助，便把寻人作为自己的“日常工作”。不仅如此，他还用做更多的好事传承爱心。为辖区的环卫工人免费提供早餐，这和寻人相比需要付出更多。\n</div> \n<div>\n  　　孙明忠做了很多年好事，而且没有停下来的打算，他把自己的门店设置为“体彩驿站”，常年为购彩者和周边居民提供便利服务。这样的事，他打算一直做下去。在全国，像孙明忠这样的体彩销售人员还有很多，他们挤出难得的休息时间，帮扶失学儿童、孤寡老人等群体，自觉践行体育彩票“乐善人生”的公益理念，温暖着他人，也温暖着这个社会。（艾禾）\n</div>', NULL, '中国体彩报', '时评：做一辈子好事', '2019-06-09 12:47:57', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821538086912', '<div>\n  　　6月2日，文旅融合、美好生活、快乐运动、幸福鹤乡，“体彩嘉年华·大乐透杯”全民健身徒步行活动在吉林省白城市生态新区鹤鸣湖举行。该市市直机关、各协会、团体及社会自发参与团队近3000人参加了此次活动。这次活动是近年来白城市规模较大的一次群众体育活动。\n</div> \n<div>\n  　　白城市体彩中心为此次活动精心准备，在起点旁设立舞台，准备了歌曲、舞蹈和以扫黑除恶为主题的快板等精彩节目的同时，还制作了8面印有体彩元素的水刀旗，5个方向提示板、2个医疗点指示牌和3000件印有体彩宣传语的T恤，在舞台旁举办了“体彩嘉年华”的地推活动。这些举措不仅为活动增添色彩，营造氛围，而且很好地宣传了体育彩票品牌，并把“公益体彩，乐善人生”的发行宗旨深入每个人的心中。\n</div> \n<div>\n  　　一个小朋友兴高采烈地告诉记者：“这个活动太有意思了，这里的景色也很美，以后每天我都要来玩一会。”陪同孩子的家长也表示说：“感谢体彩为市民承办的这次活动，不但有益健康，也丰富了大家的业余生活，以后我还要继续购买体育彩票。”\n</div> \n<div>\n  　　由白城市体育彩票管理中心承办的此次活动丰富了不同人群的健身需求，娱乐需求，更促进了体育旅游和体育产业的融合发展。（张吉 晨光）\n</div>', NULL, '中国体育报', '支持群众健身 白城体彩助力健步走活动', '2019-06-06 16:22:34', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821575835648', '<p style=\"text-align: center;\"> <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190606/2019060616170563.png\" style=\"width: 600px; height: 399px;\"></p> \n<div>\n  　　6月4日，四川省体育局党组书记、局长罗冬灵带队到省体育彩票管理中心，调研走访了中心直营店、兑奖大厅和部门办公室，慰问体彩干部职工，查看销售设施设备，并组织召开调研座谈会，详细了解全省体彩工作情况，分析存在的困难和问题，安排部署下一步工作。\n</div> \n<div>\n  　　座谈会上，罗冬灵通过引用唐代诗人孟浩然“荷风送香气，竹露滴清响”的诗句，评价省体彩管理中心今年以来取得的工作成绩。“清”即为思路清晰、行业清风，“响”即为落地有声、执行到位。具体体现出五个特点：一是目标立起来了，坚决执行局党组的决策部署，明确了“保安全、促发展”的发展目标。二是精神立起来了，面对政策调整、安全压力等新形势，体彩干部职工展现出了信念坚定、不气不馁、勇争一流的精神面貌。三是管理立起来了，今年以来，省中心积极推行放权让利，释放了体彩的活力，体现了管理的创新性和实效性。四是作风立起来了，体彩干部职工脚踏实地，工作务实、求实、扎实，富有成效。五是形象立起来了，1至5月，全省体育彩票销售37.8亿元，树立起了四川体彩的良好形象。会议同时指出，当前全省体育彩票工作还存在安全压力较大、市场竞争激烈、队伍能力急需提升等问题。\n</div> \n<div>\n  　　座谈会以“宣传体彩正能量，安全规范科学化，积极融入市场化，服务四川大体育”为主题，对下一步工作提出了八点要求。一是用我们的胸怀让体彩更加深入人心。广泛宣传体彩，加大宣传力度和深度，让宣传深入千家万户，做到抬头看到体彩广告，低头看到体彩身影。二是用我们的情怀让体彩更加惠及百姓。通过送体彩知识上门、送体育比赛上门、送体彩温暖上门等措施，让老百姓切身感受到体彩的温暖和实惠。三是用我们的担当让体彩更加严守安全。要加强学习，提高自身安全意识和工作水平；要及时排查安全隐患，坚决整改安全问题；要遵循规律开展安全工作。对于体彩来讲，要做好站点、网络、数据、资金、设施、消防等方面的安全工作，确保万无一失。四是用我们的智慧让体彩更加融入市场。要运用营销学和经济学知识，研究如何让体彩入市进场，更好地顺应市场、融入市场、拓展市场。五是用我们的使命让体彩更加规范发展。不断加强党的建设，充分发挥党建的引领作用，进一步完善制度，严格执行制度，提升管理水平。六是用我们的自律让体彩更加彰显清风。坚持把纪律挺在前面，学习法纪知识、增强法纪观念，汲取教训、警钟长鸣、严格自律，同时接受社会监督。七是用我们的历练让体彩更加树人立威。不断提升体彩干部的综合素质，特别是参与市场经济的能力，练就发展“硬功夫”，在激烈的市场竞争中占据优势、赢得主动，重塑四川体彩人的形象。八是用我们的执著让体彩更加历练品牌。树立大体育发展观，积极为体育深度融入经济社会发展作出贡献，打造干部团队的品牌、体彩行业的品牌和四川体育发展“123456”战略中“助力发展”的品牌。\n</div> \n<div>\n  　　罗冬灵最后殷切希望全省体彩人用智慧和汗水，“游”好挤市场、占份额、作贡献、塑品牌的“泳”，成为市场经济的“游泳健将”，在体彩奥运的奖台上，插上四川体彩的旗帜。\n</div> \n<div>\n  　　四川省体育局党组成员、副局长季涛，局办公室、产业处等相关处室负责人，省体彩管理中心全体干部职工，部分市州分中心负责人参加调研或座谈。（川彩）\n</div>', NULL, '中国体育报', '体彩融入市场化 服务四川大体育', '2019-06-06 16:15:59', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821605195776', '<div>\n  　　2008年，体彩即开型彩票顶呱刮上市，其即开即兑、好玩易中、票面精美等特点，吸引了无数购彩者，也吸引着众多网点销售业主将其作为主推产品进行销售。\n</div> \n<div>\n  　　11年间，顶呱刮的魅力不断显现，在体彩销售业主成就了一批收藏爱好者、即开型彩票销售高手、以及诚信业主。他们见证了顶呱刮从无到有的发展历程，和25岁的中国体育彩票一同“绽放”。\n</div> \n<div> \n <strong>　　山东德州20128网点李玉柱</strong>\n</div> \n<div> \n <strong>　　收藏顶呱刮 他被称“展览馆馆长”</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609123431187.jpg\" style=\"width: 500px; height: 300px;\">\n</div> \n<div>\n  　　李玉柱是山东德州20128网点的业主，已年过七旬。从业15年以来，他见证了顶呱刮十余年来的成长历程，成为一名资深收藏爱好者，几乎收藏了顶呱刮上市至今的所有票种。在当地的业主交流群中，李玉柱的投注站被称为“顶呱刮彩票展览馆”，他本人则被称为“馆长”。\n</div> \n<div>\n  　　2004年，李玉柱所在的工厂效益不佳，员工纷纷自谋出路。临近退休年龄的李玉柱，接手了一家转让的体彩店。\n</div> \n<div>\n  　　刚接手时，体彩店的销售额并没有预期高。2008年3月，顶呱刮上市，其简单的游戏玩法、精美的画面、即买即开即兑的特点受到购彩者的喜爱。\n</div> \n<div>\n  　　“奥运主题票的票面精美，让我对顶呱刮一见钟情，逢人便推荐，没过多久，它就成为我店里销售最好的票。”李玉柱坦言，如今有很多新的投注站业主向他取经，他总是告诉他们，自己店里顶呱刮之所以卖得好，是因为自己发自内心的喜爱，购彩者是被他的真诚而打动。\n</div> \n<div>\n  　　因为喜爱，李玉柱将上市的每一个票种都悉心收藏，擦拭干净后整齐地贴在杂志上，现在已经收集了很多本，经常被购彩者要求拿出来展示，自己的小店也成了业主群里有名的“顶呱刮彩票展览馆”。\n</div> \n<div>\n  　　“虽然年纪越来越大，体力不如从前，但我从来没想过关门，儿子们抽空会过来帮忙。这个小店如同一台摄像机，记录了十年来我们一家人的幸福时光。如今，孙子们都已经满地跑了，也喜欢翻看我收藏的顶呱刮彩票，我也经常给他们讲这一张张彩票背后的故事。我觉得我得再干个十年，让孙子们听着我和顶呱刮的故事长大。”说起这些美好的愿望，李玉柱眼中写满憧憬。\n</div> \n<div> \n <strong>　　四川成都01391网点陈小玲</strong>\n</div> \n<div> \n <strong>　　归还顶呱刮传递体彩诚信精神</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609123443120.jpg\" style=\"width: 500px; height: 333px;\">\n</div> \n<div>\n  　　体彩顶呱刮即开即兑，在销售过程中，体彩业主们总是提醒购彩者，认真仔细核对中奖区，以免错过大奖，但事实上仍有个别购彩者刮奖不细致，出现漏刮、漏兑的情况。作为诚信业主，他们主动将漏兑的奖金，归还给中奖者。\n</div> \n<div>\n  　　在这些诚信业主中，四川成都01391网点业主陈小玲的故事尤为感人。\n</div> \n<div>\n  　　2013年1月22日，四川体彩举行“传递诚信共建文明———即开型体育彩票顶呱刮150万元大奖颁奖仪式”，诚信业主陈小玲获得了“中国体育彩票诚信销售网点”奖牌及奖杯。\n</div> \n<div>\n  　　据了解，2012年6月19日，成都一购彩者在彩票奖金区还没有完全刮开时，误将150万元大奖当作1500元兑奖，陈小玲苦寻4天找到了当事购彩者。为保证依法公开公正兑奖，四川省体彩中心建议购彩者通过司法途径维护权益。在陈小玲和体彩中心的多方努力下，购彩者终于成功领取150万元。\n</div> \n<div>\n  　　面对150万元大奖，陈小玲完全可以据为己有，但是她并未动心。“如果我把这笔奖金拿了，我一辈子都不会心安。”陈小玲说，他以以前当过乡村小学教师，“我总给学生们讲，做人要诚信。我对自己也是这样要求的，谁中了奖，奖金就是谁的。不要说150万元，就算是1500万我也不会要。我只是一个普通人，做了一件普通事。”\n</div> \n<div>\n  　　荣誉纷至沓来，陈小玲的表现却很平静，她说：“平日里，体彩中心对业主诚信经营的培训十分重视，所以我能做到这一切，与中心的每一位工作人员都是密不可分的。希望在将来的日子里，能出现更多的诚信业主，更好地为购彩者服务。”\n</div> \n<div> \n <strong>　　河南洛阳06418网点张社会</strong>\n</div> \n<div> \n <strong>　　宣传顶呱刮“讲故事”讲出状元郎</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609123635871.jpg\" style=\"width: 500px; height: 333px;\">\n</div> \n<div>\n  　　河南洛阳06418网点藏身于栾川县陶湾汽车站院内，地处山坳。尽管所处地段不佳，但网点依然做到了单月顶呱刮销售额最高80万元、年销售几百万元的好成绩，连续多年保持洛阳市体彩即开型彩票销售额第一。\n</div> \n<div>\n  　　张社会是06418网点的业主，2008年开始接手经营。在经营过程中，张社会发现当地人对即开即兑的彩票兴趣更大，于是他开始力推顶呱刮，一个月下来销售增加不少。后来，张社会理清了思路，以即开型彩票销售为主。\n</div> \n<div>\n  　　张社会认为，车站客流量大，等车的人多，只要抓住机会，能让客户进店，就有销售彩票的可能。他先是买了个大喇叭，架在站牌，反复播报中奖信息；然后将网点可以提供免费休息、免费寄存行李、免费饮水、免费阅读等一系列服务的“招牌”打出。慢慢地，等车的人习惯到店里休息一会儿，趁着这个机会，张社会开始推广。\n</div> \n<div>\n  　　为了宣传即开型彩票，张社会费了很多心思，他先是将废票叠成各种手工艺品，比如船、花篮、鸭子、猴子等造型，发现叫好不叫座之后，又开始思考其它方法。\n</div> \n<div>\n  　　山里人资讯获取的渠道少，爱听故事，尤其是带点传奇色彩的故事。一次，网点里有对情侣等车，男方给女方随手买了张顶呱刮，结果中了1000元，第二天女方请男方吃饭，又来到网点里买彩票，又中了500元。张社会把这件事编成顺口溜贴在墙上，没想到宣传效果挺好。后来，每有一个中奖故事，张社会就“采访”中奖者，把事情编成顺口溜打印出来。\n</div> \n<div>\n  　　栾川陶湾有很多村民都外出打工，由于张社会在当地名声比较响，村民外出不忘宣传“我们那里有个体彩网点业主，分析彩票可有一套”。后来，一个浙江购彩者听到了张社会的故事，慕名向他电话取经，结果真中了50万元。中奖之后，购彩者与家人驾车赶过来，送给张社会一把宝剑。这把宝剑至今仍悬挂在网点墙上。（陈敏）\n</div>', NULL, '中国体彩报', '体彩业主与顶呱刮一同“绽放”', '2019-06-09 12:32:45', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821647138816', '<div>\n  　　世界上第一款彩票出现在2000多年前的古罗马，我国最早的彩票出现在南宋时期。1984年10月10日，经有关部门批准，中国田径协会和中国体育服务公司在北京销售“体育发展奖———一九八四年北京国际马拉松赛”奖券，这是新中国第一次发行彩票。随后，福建省发行了“福建省体育中心建设纪念奖券”。\n</div> \n<div>\n  　　1994年4月5日，国家体委体育彩票管理中心（现国家体育总局体育彩票管理中心）成立。25年来，即开型体育彩票共发行610余款，其中包括顶呱刮（2008年面市）430余款。顶呱刮的LOGO是一个大姆指，上市十余年来，顶呱刮的发行量超过1663亿元（截至2019年6月3日），筹集公益金超过332亿元，为社会公益事业作出贡献。顶呱刮不断通过发行赛事类、财富类、节庆类等主题票，传播体彩文化、展示顶呱刮的魅力。\n</div> \n<div>\n  　　解读1：第一张体育彩票是什么\n</div> \n<div> \n <strong>　　1984年发行北京马拉松奖券</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609122651688.jpg\" style=\"width: 321px; height: 565px;\">\n</div> \n<div>\n  　　年纪稍大点的人或许都还记得，上世纪八九十年代即开型彩票集中销售时的火爆场景，除了现金奖外，还有实物奖，奖品包括汽车、洗衣机、自行车乃至毛巾、肥皂等。谁家骑回一辆自行车，谁家抱回一台洗衣机，都是街坊邻居热议的话题，语气中带着“羡慕嫉妒恨”。\n</div> \n<div>\n  　　新中国第一次发行彩票是在1984年，中国田径协会和中国体育服务公司在北京销售“体育发展奖———一九八四年北京国际马拉松赛”奖券。随后，福建省发行了“福建省体育中心建设纪念奖券”。\n</div> \n<div>\n  　　北京国际马拉松赛奖券，自1984年至1994年共发行了11期，除1984年是竖式外，其余均为传统型，正面印有运动员赛跑图、会徽、主办单位、协办单位等信息，背面印有广告。北京首期马拉松彩票是新中国的龙头体育彩票，应该说是彩票中的“珍品”，极具收藏价值。\n</div> \n<div>\n  　　1994年至1995年，体育彩票以面额2元的即开型、传统型及即开传统结合型彩票为主，销售额为10亿元，筹集的3亿元公益金主要用于补充第43届世乒赛等13项大型赛事的举办经费的不足，为体育事业的发展开辟了一条新路。\n</div> \n<div>\n  　　1998年初，国家体委体育彩票管理中心发行编号为9802J30ESB的即开型“中国体育彩票四周年纪念彩票”，全套15枚。除首枚主图为中国体育彩票标志外，其余14枚均为4年间中国体育彩票公益金资助过的14项国际国内重大赛事的会徽和吉祥物。2000年4月1日起，即开型彩票销售中取消实物返奖。\n</div> \n<div>\n  　　解读2：已发行了多少款即开票\n</div> \n<div> \n <strong>　　610余款彩票受购彩者热捧</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/2019060912272958.jpg\" style=\"width: 550px; height: 365px;\">\n</div> \n<div>\n  　　据统计，截至2019年6月3日，即开型体育彩票一共发行了610余款。2008年3月，即开票华丽转身，体彩顶呱刮上市销售，发行了“勇争第一”“好运中国”“奥运金牌”等一批奥运主题即开票，受到购彩者热捧，当年仅9个月就发行了103亿元。\n</div> \n<div>\n  　　顶呱刮上市一个多月后，汶川地震发生，从2008年7月1日至2010年12月31日，顶呱刮彩票的中央公益金部分38.3亿元（发行量的10%）全部用于灾后重建，被大家誉为“赈灾彩票”。\n</div> \n<div>\n  　　从2008年上市至2019年6月3日，顶呱刮累计发行430余款，发行量超过1653亿元，筹集公益金超过332亿元。\n</div> \n<div>\n  　　解读3：最畅销的是哪一款彩票\n</div> \n<div> \n <strong>　　“点石成金”领衔六大经典票种</strong>\n</div> \n<div style=\"text-align: center;\"> \n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609122743462.jpg\" style=\"width: 600px; height: 450px;\">\n</div> \n<div>\n  　　2009年上市的“点石成金”是首款面值20元、头奖100万元的即开票，也是发行量最多、出奖最多的票种，上市10年来畅销不衰。截至2019年6月3日，“点石成金”发行119亿元，贡献公益金超过23亿元。2012年，升级版“点石成金Ⅱ”上市后，同样出奖不断。此外，排名发行量第二至六位的分别是：“绿翡翠”81.49亿元、“十倍幸运”79.62亿元、“麻辣6”70.57亿元、“甜蜜蜜”68.00亿元、“宝石之王”54.18亿元。\n</div> \n<div>\n  　　这六款畅销票中既有5元面值的“甜蜜蜜”“麻辣6”，也有10元面值的“绿翡翠”“十倍幸运”，还有20元面值的“点石成金”和30元面值的“宝石之王”。其中2011年上市的“宝石之王”，是首款30元面值即开票，也是首款头奖150万元的即开票。\n</div> \n<div>\n  　　顶呱刮因其票面精美、主题鲜明，成为传播体彩文化的重要载体，也成为继邮票、钱币、电话磁卡之后的又一个深受玩家欢迎的收藏品种。顶呱刮从一个侧面记录和反映了某一时期的历史风貌。如2008年、2012年、2016年发行的奥运会主题票以及每年春节期间发行的贺岁主题票等。\n</div> \n<div>\n  　　解读4：顶呱刮印制技术有何创新\n</div> \n<div> \n <strong>　　大奖彩票由计算机“随机”生成</strong>\n</div> \n<div>\n  　　顶呱刮是一种采用计算机、网络通讯和二维条码等技术手段进行发行和销售的全新的网点即开型体育彩票，采用现今世界先进的二维条码防伪保安识别系统和与之相配套的先进的销售物流管理系统，使销售管理工作更加规范。\n</div> \n<div>\n  　　顶呱刮的印制技术处于全球领先状态，二维码技术使得每一张即开票随机拥有一组独一无二的“身份证”。票面中奖符号是由计算机系统设计的，设计程序并没有给中奖符号提供具体的票面位置，只是设计出每多少万元一个奖组、大小奖如何分布等规则。规则产生后，设计程序自动生成一套设奖方案。设计人员每天开启计算机时，计算机“自行决定”会在第几张彩票产生中奖符号。\n</div> \n<div>\n  　　IVT、BCR兑奖扫描终端，实现了顶呱刮在线兑奖、查询功能，告别了以往仅凭人手、肉眼兑奖的方式。购彩者可以安心购买，销售人员也可以放心兑奖了。\n</div> \n<div>\n  　　解读5：顶呱刮不断丰富兑奖方式\n</div> \n<div> \n <strong>　　自助兑奖真正实现“即中即兑”</strong>\n</div> \n<div>\n  　　2018年3月，体彩顶呱刮推出新型兑奖方式———手机淘宝/支付宝/微信自助兑奖在全国大部分省份统一推广实施，全国的购彩者陆续体验到了新型兑奖模式带来的便利、优质和高效的服务。\n</div> \n<div>\n  　　传统的体彩顶呱刮“即中即兑”模式，需要购彩者持中奖彩票到体彩销售网点，由体彩销售员使用专用设备兑奖，然后当场将奖金给予购彩者。\n</div> \n<div>\n  　　随着移动互联网的快速发展，支付方式也发生了很大的变化，扫描二维码就能轻松实现多种场景下的快速支付，可以说人们的生活和移动支付已经密不可分。在这种大环境下，购彩者更希望能体验到真正意义上的“即中即兑”，将票面上的中奖奖金快速收入囊中。\n</div> \n<div>\n  　　体彩顶呱刮自助兑奖功能的上线，实现了小额奖金更为便捷的“即中即兑”自助领奖。自助兑奖操作简单，方便快捷，中奖者只需要刮开彩票兑奖区（保安区）（注：彩票不会失效），然后打开手机淘宝、支付宝或微信，扫一扫保安区的兑奖二维码，按照提示点击兑奖，通过系统实名认证后，即可实现小额奖金（1000元及以下）的自助兑奖。奖金将自动进入相应兑奖客户端的账户。\n</div> \n<div>\n  　　自助兑奖为购彩者提供了更便捷的兑奖服务，更优质、更高效的兑奖体验。一是购彩者可以选择随时随地兑奖，不再受时间和地域的限制，丰富了体彩顶呱刮的娱乐消费场景，使得体彩顶呱刮作为礼品馈赠、奖品促销后的兑奖问题得到有效改善；二是兑奖速度快，让购彩者体验到体彩顶呱刮中奖后快速领取奖金的感觉；三是手机淘宝、支付宝、微信都可以兑奖；四是售彩高峰期体彩销售网点的销售员往往是最忙的，他们在销售电脑型彩票的同时还要使用传统兑奖设备为体彩顶呱刮中奖者兑奖，自助兑奖的推出可减轻网点销售员的压力，提高对购彩者的服务质量。（于彤）\n</div>', NULL, '中国体彩报', '贡献332亿公益金 解读顶呱刮的“前世今生”', '2019-06-09 12:26:25', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821680693248', '<div style=\"text-align: center;\">\n  　\n <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190609/20190609123125605.jpg\" style=\"width: 600px; height: 400px;\">　\n</div> \n<div>\n  　　5月25日晚，体彩大乐透第19059期开奖，二等奖开出127注，单注奖金为36.25万元；其中62注采用追加投注，每注多得奖金29万元。追加后，二等奖单注总奖金为65.25万元。江西上饶、景德镇购彩者分别中得二等奖和追加二等奖。\n</div> \n<div>\n  　　上饶的二等奖出自信州区沙溪镇08106体彩网点。据网点业主陈先生介绍，该网点经营已有10年，中出的小奖不计其数，但这样高的奖金是第一次中出，附近居民看到网点的中奖条幅后，开始都不敢相信，以为是“骗人的”，在了解了体彩开奖的公开、公平、公证后，大家纷纷投注，参与到这项公益事业中。开奖当天，中奖的购彩者认为自己投注的号码有“灵感”。开奖次日，中奖者问业主：“中了奖如何兑奖，是不是要到南昌领奖，地址在哪儿？”\n</div> \n<div>\n  　　“中奖不是结束，而是新的开始。”陈先生说，“以后我会继续努力做好体彩销售工作，为体彩公益事业出一份力，也会告诉身边的朋友，参与购买体彩，为体彩公益事业奉献自己的爱心。如果中了奖，可以让生活变得更有趣、更精彩。”\n</div> \n<div>\n  　　同在5月25日，快递员小徐刚从景德镇乐平天湖城小区送完快递，准备到附近的早餐店吃早点，寻找之际，看见一家体彩网点已开门，心想时间还早，不如进去买几注彩票碰碰运气。小徐一进网点，业主小周便向他介绍了体彩大乐透新规则，此后，小徐就按业主的推荐打了几注追加票。\n</div> \n<div>\n  　　原本只想碰碰运气，即使不中奖也能为国家公益事业出点力。5月27日，小徐送快件时又路过两天前买彩票的网点，发现门口张贴了喜报，宣传乐平有购彩者中得大乐透二等奖65万元之多，他还同网点业主调侃：“谁会有那么好的运气，真是家里烧高香了！”\n</div> \n<div>\n  　　出了网点，小徐想起自己还有几张彩票没有核对，心想，这个中奖者不会是自己吧？回去拿彩票核对开奖结果，发现自己真的中了奖。小徐兑奖后说，他想利用这笔钱改善一下自己的生活，今后还会为公益事业贡献力量。（江家印周文辉）\n</div>', NULL, '中国体彩报', '上饶景德镇购彩者分中大乐透二等奖', '2019-06-09 12:28:14', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821722636288', '<p style=\"text-align: center;\"> <img alt=\"\" src=\"http://www.lottery.gov.cn/upload/20190602/20190602112212542.jpg\" style=\"width: 416px; height: 248px;\"></p> \n<p> 　　大乐透自2月20日实施新规则后，江西各地相继传出喜讯，大奖小奖接连不断。<br> 　　5月23日一早，宜春市奉新县城内便听到锣鼓声，很多人都被吸引过去，14601体彩网点一购彩者中得大乐透二等奖2注，奖金114.3万元。<br> 　　业主和当地体彩工作人员对此进行宣传，邀请了锣鼓队助阵，制作了条幅、彩虹门、中奖宣传喜报等，场面热烈，许多老购彩者纷纷投去羡慕的目光。<br> 　　据网点业主介绍，中奖者是一位小伙子，经常购买大乐透彩票，这次他投注了6＋3复式票，最终收获幸运。（况春）</p>', NULL, '中国体彩报', '宜春网点庆祝中大乐透二等奖', '2019-06-02 11:21:01', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821756190720', '<p> 　　4月30日，排列3第19113期开出奖号472。浙江衢州64014体彩网点购彩者叶先生凭借一张45倍投注的直选票，中得奖金4.68万元。<br> 　　叶先生购彩心态良好，投注一直很理性，当期他凭直觉选定472时，本来想着像往常一样打5倍就行，但当时店内购彩者众多，网点业主忙中出错将5倍误打成了45倍。叶先生和网点的业主是朋友，出票后发现倍数打错时，经商量后决定各承担一半的投注金额，如果中奖的话奖金也对半分。<br> 　　结果，幸运之神降临，当期开出的奖号正是472，叶先生和网点业主合计收获4.68万元奖金。（宗合）</p>', NULL, '中国体彩报', '单式倍投 衢州购彩者中排列3奖金4.68万', '2019-06-02 11:06:53', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lottery_information` VALUES ('1137690821798133760', '<div>\n  　　7星彩作为上市较早的体彩大盘玩法，拥有一批忠实的粉丝。前不久，来自海南海口的彭先生、陕西西安的王先生，分别现身领走500万元头奖。两位大奖得主均为7星彩的老购彩者，养成了坚持投注的习惯。\n</div> \n<div> \n <strong>　　“奖金先还欠款”海口私企老板中走500万</strong>\n</div> \n<div>\n  　　前不久，海南海口购彩者彭先生现身省体彩中心，领走7星彩500万元大奖。\n</div> \n<div>\n  　　4月23日，在体彩7星彩第19046期开奖中，彭先生凭借一张5注10元投入的单式票，中出1注500万元头奖。\n</div> \n<div>\n  　　彭先生买7星彩已经有四五年。“每期都买，每次都差不多机选10元。”彭先生说，自己是一个体育爱好者，知道发行体育彩票筹集公益金主要用于支持体育公益事业，对体育彩票颇有好感，尤其热衷7星彩玩法。他用坚持购买7星彩的方式来支持体彩公益事业，同时又给自己买一份希望。\n</div> \n<div>\n  　　当期开奖日前一天，彭先生加完班到公司附近的一家体彩店，买了饮料后顺便让销售员机选了7星彩5注号码。对于他来说这个习惯已经保持很久了。没想到，当期开奖后，彭先生买的那张机选票击中1注500万元大奖！“机选一次中了，真是运气到了。”彭先生笑称是自己坚持购彩，迎来的好运气。\n</div> \n<div>\n  　　“这笔奖金来得太及时了，主要用来还欠款，然后继续投入到自己的事业中去。”彭先生说，他目前经营一家公司，经营过程中资金短缺，还有部分欠款，这笔奖金不仅帮他缓解燃眉之急，还有利于进一步拓展他的事业。\n</div> \n<div> \n <strong>　　第一时间告诉媳妇　西安购彩者守号中走500万</strong>\n</div> \n<div>\n  　　5月14日，陕西西安购彩者王先生现身省体彩中心，领走7星彩500万元头奖。\n</div> \n<div>\n  　　5月12日，在体彩7星彩第19054期开奖中，王先生凭借一张5注10元投入的单式票，击中1注500万元一等奖。\n</div> \n<div>\n  　　王先生今年40岁，是个体彩迷，特别喜欢7星彩，习惯采用守号进行投注。这次中奖的7星彩号码正是守了一年多时间中得。\n</div> \n<div>\n  　　王先生说，他买彩票有9年多，喜欢用手机号码作为选号灵感，再编成号码进行投注，“因为7星彩的号码要排序对位，所以趣味性更强。”\n</div> \n<div>\n  　　5月11日晚，王先生陪着媳妇散步回家，路过彩票店买了这张彩票。他说，在这之前，300元的四等奖中过4次，此外没中过啥大奖，但因为喜欢体育彩票，信赖体育彩票的公正性，所以中不中奖都没太在意。\n</div> \n<div>\n  　　王先生说，得知中奖还是非常激动，第一时间就把这个好消息告诉了媳妇。这500万元奖金对他们这个家庭来说是很大一笔钱，能给家人提供更好的生活。\n</div>', NULL, '中国体彩报', '两地购彩者“坚持投注” 各擒7星彩500万', '2019-05-30 13:41:52', NULL, NULL, NULL, '2023-04-18 12:58:11', NULL, '2023-04-18 12:58:11', NULL, NULL, NULL, NULL, NULL);
